UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Info]=N'<div class="sub-header-1">"Incomplete" Answer Rationale</div>
<p>
     This requirement can be partially effective even if not completely or properly implemented, and the points deducted
     may be adjusted depending on how the security requirement is implemented.
</p>
<p>
     Multi-factor authentication (MFA) is typically implemented first
     for remote and privileged users (since these users are both limited in number and more critical) and then for the
     general user, so three (3) points are subtracted from the maximum score if MFA is implemented only for remote and
     privileged users. Five (5) points are subtracted from the maximum score if MFA is not implemented for any users.
</p>
<div class="sub-header-1">ASSESSMENT OBJECTIVES [NIST SP 800-171A]</div> Determine if: <ol class="alpha-bracket">
     <li>privileged accounts are identified;</li>
     <li>multifactor authentication is implemented for local access to privileged accounts;</li>
     <li>multifactor authentication is implemented for network access to privileged accounts; and</li>
     <li>multifactor authentication is implemented for network access to non-privileged accounts.</li>
</ol>
<div class="sub-header-1">POTENTIAL ASSESSMENT METHODS AND OBJECTS</div>
<div class="sub-header-2">Examine</div>
<p>[SELECT FROM: Identification and authentication policy; procedures addressing user identification and authentication;
     system security plan; system design documentation; system configuration settings and associated documentation;
     system audit logs and records; list of system accounts; other relevant documents or records].</p>
<div class="sub-header-2">Interview</div>
<p>[SELECT FROM: Personnel with authenticator management responsibilities; personnel with information security
     responsibilities; system or network administrators].</p>
<div class="sub-header-2">Test</div>
<p>[SELECT FROM: Mechanisms supporting or implementing authenticator management capability].</p>
<div class="sub-header-1">DISCUSSION</div>
<p>Multifactor authentication requires the use of two or more different factors to authenticate. The factors are defined
     as something you know (e.g., password, personal identification number [PIN]); something you have (e.g.,
     cryptographic identification device, token); or something you are (e.g., biometric). Multifactor authentication
     solutions that feature physical authenticators include hardware authenticators providing time-based or challenge-
     response authenticators and smart cards. In addition to authenticating users at the system level (i.e., at logon),
     organizations may also employ authentication mechanisms at the application level, when necessary, to provide
     increased information security. Access to organizational systems is defined as local access or network access.
     Local access is any access to organizational systems by users (or processes acting on behalf of users) where such
     access is obtained by direct connections without the use of networks. Network access is access to systems by users
     (or processes acting on behalf of users) where such access is obtained through network connections (i.e., nonlocal
     accesses). Remote access is a type of network access that involves communication through external networks. The use
     of encrypted virtual private networks for connections between organization-controlled and non-organization
     controlled endpoints may be treated as internal networks with regard to protecting the confidentiality of
     information.</p>
<p>NIST SP 800-63-3 provides guidance on digital identities.</p>
<div class="sub-header-1">FURTHER DISCUSSION</div>
<p>Implement a combination of two or more factors of authentication to verify privileged account holders’ identity
     regardless of how the user is accessing the account. Implement a combination of two or more factors for
     non-privileged users accessing the system over a network.</p>
<p>The implementation of multi-factor authentication will depend on the environment and business needs. Although
     two-factor authentication directly on the computer is most common, there are situations (e.g., multi-factor
     identification for a mission system that cannot be altered) where additional technical or physical solutions can
     provide security. If a mobile device is used to access a system or application containing CUI, multi-factor
     authentication is required.</p>
<p>This requirement, IA.L2-3.5.3, requires multifactor authentication for network access to non-privileged accounts and
     complements five other requirements dealing with remote access (AC.L2-3.1.12, AC.L2-3.1.14, AC.L2-3.1.13,
     AC.L2-3.1.15, and MA.L2-3.7.5:</p>
<ul>
     <li>AC.L2-3.1.12 requires the control of remote access sessions.</li>
     <li>AC.L2-3.1.14 limits remote access to specific access control points.</li>
     <li>AC.L2-3.1.13 requires the use of cryptographic mechanisms when enabling remote sessions.</li>
     <li>AC.L2-3.1.15 requires authorization for privileged commands executed during a remote.</li>
     <li>Finally, MA.L2-3.7.5 requires the addition of multifactor authentication for remote maintenance sessions.</li>
</ul>
<p>This requirement, IA.L2-3.5.3, also enhances IA.L2-3.5.2, which is a requirement for a less rigorous form of user
     authentication.</p>
<div class="sub-header-2">Example</div>
<p>You decide to implement multifactor authentication (MFA) to improve security of your network. Your first step is
     enabling MFA on VPN access to your internal network [c,d]. When users initiate remote access, they will be prompted
     for the additional authentication factor.</p>
<p>Because you also use a cloud-based email solution, you require MFA for access to that resource as well [c,d].
     Finally, you enable MFA for both local and network logins for the system administrator accounts used to patch and
     manage servers [a,b,c].</p>
<div class="sub-header-2">Potential Assessment Considerations</div>
<ul>
     <li>Does the system uniquely identify and authenticate users, including privileged accounts [b,c,d]?</li>
</ul>' WHERE [Mat_Question_Id] = 5330
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Info]=N'<div class="sub-header-1">"Incomplete" Answer Rationale</div>
<p>
     This requirement can be partially effective even if not completely or properly implemented, and the points deducted
     may be adjusted depending on how the security requirement is implemented.
</p>
<p>
     FIPS-validated encryption is required to protect the
     confidentiality of CUI. If encryption is employed, but is not FIPS-validated, three (3) points are subtracted from
     the maximum score; if encryption is not employed; five (5) points are subtracted from the maximum score.
</p>

<div class="sub-header-1">ASSESSMENT OBJECTIVES [NIST SP 800-171A]</div> Determine if: <ol class="alpha-bracket">
     <li>FIPS-validated cryptography is employed to protect the confidentiality of CUI.</li>
</ol>
<div class="sub-header-1">POTENTIAL ASSESSMENT METHODS AND OBJECTS</div>
<div class="sub-header-2">Examine</div>
<p>[SELECT FROM: System and communications protection policy; procedures addressing cryptographic protection; system
     security plan; system design documentation; system configuration settings and associated documentation;
     cryptographic module validation certificates; list of FIPS-validated cryptographic modules; system audit logs and
     records; any other relevant documents or records].</p>
<div class="sub-header-2">Interview</div>
<p>[SELECT FROM: System or network administrators; personnel with information security responsibilities; system
     developers; personnel with responsibilities for cryptographic protection].</p>
<div class="sub-header-2">Test</div>
<p>[SELECT FROM: Mechanisms supporting or implementing cryptographic protection].</p>
<div class="sub-header-1">DISCUSSION</div>
<p>Cryptography can be employed to support many security solutions including the protection of controlled unclassified
     information, the provision of digital signatures, and the enforcement of information separation when authorized
     individuals have the necessary clearances for such information but lack the necessary formal access approvals.
     Cryptography can also be used to support random number generation and hash generation. Cryptographic standards
     include FIPS-validated cryptography and/or NSA-approved cryptography.</p>
<div class="sub-header-1">FURTHER DISCUSSION</div>
<p>FIPS-validated cryptography means the cryptographic module has to have been tested and validated to meet FIPS 140-2
     requirements. Simply using an approved algorithm is not sufficient – the module (software and/or hardware) used to
     implement the algorithm must be separately validated under FIPS 140. Accordingly, FIPS-validated cryptography is
     required to protect CUI when transmitted or stored outside the protected environment of the covered OSA information
     system (including wireless/remote access). Encryption used for other purposes, such as within applications or
     devices within the protected environment of the covered OSA information system, would not need to use
     FIPS-validated cryptography.</p>
<p>This requirement, SC.L2-3.13.11, complements AC.L2-3.1.19, MP.L2-3.8.6, SC.L2-3.13.8, and SC.L2-3.13.16 by specifying
     that FIPS-validated cryptography must be used. While FIPS- validated modules and algorithms are critical for
     protecting CUI, in limited cases Enduring Exceptions and temporary deficiencies may apply when implementing such
     cryptographic mechanisms.</p>
<div class="sub-header-2">Example</div>
<p>You are a system administrator responsible for deploying encryption on all devices that contain CUI. You must ensure
     that the encryption you use on the devices is FIPS-validated cryptography [a]. An employee informs you of a need to
     carry a large volume of CUI offsite and asks for guidance on how to do so. You provide the user with disk
     encryption software that you have verified via the NIST website that uses a CMVP-validated encryption module [a].
     Once the encryption software is active, the user copies the CUI data onto the drive for transport.</p>
<div class="sub-header-2">Potential Assessment Considerations</div>
<ul>
     <li>Is cryptography implemented to protect the confidentiality of CUI at rest and in transit, through the
          configuration of systems and applications or through the use of encryption tools [a]?</li>
</ul>' WHERE [Mat_Question_Id] = 5382
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Fact]=N'
A credit union''s written information security program must be designed to:
    <ol>
        <li>• Ensure the security and confidentiality of member information.</li>
        <li>• Protect against any anticipated threats or hazards to the security or integrity of such information.</li>
        <li>• Protect against unauthorized access to or use of such information that could result in substantial harm or inconvenience to any member; and</li>
        <li>• Dispose of member information and consumer information properly.</li>
    </ol>
</p>

The board or the board committee oversees the credit union’s information security program. This oversight includes reviewing and approving information security policies as required by the Gramm Leach Bliley Act (GLBA) guidelines. The board’s approval of the credit union’s information security policies and program should be noted in meeting minutes of the entity responsible for overseeing the Information Security Program—either the board or a designated committee of the board.
</p>

<b>Policies:</b> Management establishes policies, standards, and procedures to support the information security program. Appropriate policies, procedures, and standards will reflect the complexity of the IT environment. 
</p>

<span>Policies, standards, and procedures guide the decisions and activities of users, developers, administrators, and managers and inform those individuals of their information security responsibilities. </span>The <b>policy</b> should establish the requirements, rules, or guiding principles that govern the information security program. Credit unions typically have a high-level Information Security Policy that meets the GLBA requirements that the board approves, and standards or guidelines that outline the expectations and technical requirements for the credit union’s information security program. <b>Procedures</b> usually define the processes that meet requirements of the policy and standards. <span></span>
</p>

<span>A credit union’s </span>written program should reflect the actual practices at the credit union, it isn’t enough to rely on templates provided by third parties.
</p>

An information security program should outline expectations in the following areas:
    <ol>
        <li>• Roles and responsibilities,</li>
        <li>• Requirement for a risk assessment,</li>
        <li>• Logical and physical access controls, authentication controls,</li>
        <li>• Encryption of data in transit and in storage,</li>
        <li>• Dual controls expectations, segregation of duties,</li>
        <li>• Monitoring Systems,</li>
        <li>• Incident Response Program,</li>
        <li>• Training Program,</li>
        <li>• Testing Program,</li>
        <li>• Patch and Change Management program,</li>
        <li>• Data disposal, and</li>
        <li>• Business Continuity and Disaster Recovery Planning.</li>
    </ol>
</p>

<b>Authentication and access controls requirements:</b> Policies and standards should define the identification and authentication requirements before access is granted to critical systems, such as core, network, and other applications and systems. Authentication requirements should include minimums for password strength, such as password length, defined character combinations, and the use of passphrases and Multi-Factor Authentication (MFA) where applicable. A passphrase is a series of words or other text that is generally longer than a  traditional password. 
</p>

Finally, the information security policy should outline the frequency and other requirements for independent testing of controls.
</p>' WHERE [Mat_Question_Id] = 7568
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Fact]=N'
To comply with GLBA guidelines, management should report at least annually to the board or responsible committee of the board on the status and effectiveness of the information security program. This report should:
<ul>
	<li>• Describe the overall status of the information security program</li>
	<li>• Address the credit union''s compliance with established guidelines</li>
	<li>• Discuss material matters related to its program, addressing security concerns that include: 
		<ul><li>- risk assessment — the results of the completed information security risk assessment should be reported to the board.</li></ul></li>
	<li>
		<ul><li>- risk management and control decisions — any changes to the credit union’s security controls, posture, or risk tolerance, and any acceptance of risk.</li></ul></li>
	<li>
		<ul><li>- service provider arrangements — information on the vendor management program, such as the breakdown of vendors by criticality, status of due diligence, any vendor concerns, or new vendors hired.</li></ul></li>
	<li>
		<ul><li>- results of testing — any issues identified in the external audits and assessments, including the status of remediation.</li></ul></li>
	<li>
		<ul><li>- security breaches — any breaches or violations and management’s responses to these incidents should be covered in the reported period; and </li></ul></li>
	<li>
		<ul><li>- recommendations — for changes to the information security program.</li></ul></li>
</ul></p>' WHERE [Mat_Question_Id] = 7577
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Fact]=N'
Risk is a function of threats, vulnerabilities, the likelihood of an event, and the potential impact such an event would have to the business. By understanding the risks, a credit union can know where to focus their efforts. A credit union can never eliminate risk. The goal of the information security program should be to provide reasonable assurance that you have made informed decisions related to the security of your information.
</p>

Risk is determined from Threats, Vulnerabilities, Likelihood, and Impact. Each credit union should establish a process to identify and evaluate reasonably foreseeable information security risks and threats to credit union assets and processes. This process should include conducting and documenting a comprehensive risk assessment that is appropriate to the credit union’s size and complexity. Like other elements of an information security program, risk assessment procedures, analysis, and results must be documented. The risk assessment includes:
	• Identifying all reasonably foreseeable threats, including internal and external threats to critical assets and applications.
	• Assessing the likelihood and impact of each threat.
	• Identifying controls in place to mitigate the risk associated with each threat, including the effectiveness of controls.
	• Evaluating the residual risk of each threat; and
	• Drafting remediation plans for unacceptable residual risk levels and the risk acceptance process.
</p>
In information security, a threat is anything that might adversely affect the information your business needs to run, or any circumstance or event with the potential to create loss. Threats are classified into three categories: 
	• Human threats: data entry errors, theft of data, etc. 
		- Internal — Employees
		- External — Vendors, hackers, nation-state actors, and others.
	• Technical threats: inadequate patching procedures, inability to restore backups, etc.; and
	• Natural/Environmental threats: fire, water, tornado, etc. 

When evaluating threats, information security professionals also assess:
	• Likelihood — what are the chances this could happen?
	• Impact — what will happen to the credit union if the threat occurs? 

A vulnerability is a weakness that could be used to harm the business. Any situation in which information is not adequately protected represents a vulnerability. Most information security breaches can be traced back to only a few types of common vulnerabilities. Controls can be administrative, technical, or physical. The following is a list of common controls:
	• policies, 
	• password controls, 
	• patch management, 
	• employee training, and
	• access reviews.

Controls might be partially implemented, or not implemented at all. It is important to consider and validate the effectiveness of the information security controls through testing, such as IT audits, vulnerability assessments, social engineering testing, and more. Inherent Risk is the amount of risk that exists in the absence of controls, while Residual Risk is the portions of risk remaining after controls and countermeasures have been applied. Residual Risk results should be communicated to the board for approval or risk acceptance. If not accepted, risk needs to be further mitigated, transferred, or avoided. Board acceptance can be simplified using risk appetite statements. Anything over the risk appetite level would require additional review and approval by the board. If no risk appetite statement is in place, the board must review all items and make individual determinations as to whether to accept the risk or not. The risk assessment should be updated at least annually and as changes occur.
' WHERE [Mat_Question_Id] = 7582
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Fact]=N'A credit union should establish an organization-wide information security awareness training program to address threats and inform employees about information security controls and the employees’ information security responsibilities. The training program should consider evolving and persistent cyber-threats, including: 
	• phishing,
	• social engineering,
	• DDoS,
	• account takeover, 
	• ransomware, and
	• any emerging issues.
	
Training should include annual certification that personnel understand their responsibilities. In addition, new employees should receive training shortly after they are onboarded.

The information security awareness training program should support policy awareness and compliance and be updated frequently to address the various types of cyber-threats by describing the threats, attack vectors, and potential impact on the credit union''s systems and members.

Best practices CIS Safeguards 14.6 instructs institutions to also train employees in recognizing and reporting a potential incident. A credit union should validate the effectiveness of their security awareness training program by employing techniques such as faux phishing campaigns or social engineering exercises. The results of these exercises can help a credit union identify areas of focus to provide additional training. Frequent testing of employees on various types of social engineering tactics helps to keep them prepared and vigilant for such attacks.

The key objective for any security awareness training program should be shaping employee behavior to reduce the likelihood and impacts of security incidents. Outcome-driven metrics tie training back to measurable protection benefits. Management should track and evaluate the results from the security awareness training program and maintain records of completed training for all employees.

Members also benefit from information security awareness. For example, credit unions can use their website to educate them about current cyber threats and methods used to illegally access accounts and account information, such as phishing, social engineering, mobile-based trojans, and business email compromise.</p>' WHERE [Mat_Question_Id] = 7588
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Fact]=N'Per Interagency Guidance on Response Programs for Unauthorized Access to Customer Information and Customer Notice, each institution should have a risk-based response program to address unauthorized access to customer information. The incident response program should be appropriate to the size and complexity of the credit union and its information security risks.

At a minimum, a credit union''s response program should outline procedures to:
	• Assess the nature and scope of an incident and identifying what member information systems and types of member information have been accessed or misused.
	• Contain and control incidents to prevent further unauthorized access to or use of member information. These should list which personnel is responsible for taking these steps.
	• Prepare, detect, contain, eradicate, remediate, follow-up on incidents. Each phase of the incident handling should list steps or procedures to follow.
	• Notify law enforcement, insurers, regulators, other incident response vendors, and members. These procedures should include applicable regulatory timeframes, as well as who to notify (for example which law enforcement agencies), and when to file a Suspicious Activity Report (SAR).</span></p>
<span>
	• Address a third-party service provider incident, including defining the related notification responsibilities. The response program should designate an incident response team and include roles and responsibilities for team members. The program should include standards for timely notification to members and outline components of the member notice.

Member notice components should be provided in plain language and include:
	• Incident description
	• Type of member information compromised
	• How the credit union will prevent further unauthorized access
	• Informational phone number
	• Reminder to members to remain vigilant over next 12-24 months
	• Request to report ID theft to CU promptly' WHERE [Mat_Question_Id] = 7594
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Question_Text]=N'Plans for identifying member information that has been accessed or misused' WHERE [Mat_Question_Id] = 7597
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Question_Text]=N'Maintain procedures to notify members, when warranted.' WHERE [Mat_Question_Id] = 7601
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Fact]=N'Credit unions have increasingly developed third party relationships to meet strategic objectives and enhance member services. Properly managed and controlled third party relationships provide a wide range of potential benefits to credit unions and their members. Many credit unions have utilized third party arrangements to gain expertise, realize economies of scale, or even reach new members. Leveraging the talents and experience of third parties can assist credit unions in meeting their members’ needs while accomplishing their strategic goals. In some cases, third party relationships are critical to the on-going success of a credit union. 

By taking the time to properly evaluate and cultivate third party arrangements, credit unions can experience a high degree of success. Prudent credit unions will conduct thorough due diligence and evaluate any third-party contracts carefully.

Credit unions use due diligence to determine whether the risks undertaken in a third-party relationship are acceptable in relation to their risk profile and safety and soundness requirements. Less complex risk profiles and third-party arrangements typically require less analysis and documentation. Management may rely on third parties to provide critical services but remains responsible for ensuring the confidentiality, integrity and availability of the credit union’s systems and information. Through oversight, a credit union monitors the effectiveness of the services provided by third parties.

Credit unions should only enter into service provider contracts that have appropriate information security measures. The contract should be clear about information security roles and responsibilities and outline the appropriate actions to address incidents of unauthorized access to or use of the credit union''s member information. The contract should clearly require timely notification to the credit union of any incidents.

When evaluating third party arrangements, examiners verify the credit union has addressed the following concepts appropriately for its size, complexity, and risk profile:
	• Risk Assessment and Planning.
	• Due Diligence; and
	• Risk Measurement, Monitoring and Control.

Vendor List
Management should maintain a current listing of all third-party service providers by risk rating/criticality (high, medium, low risk OR critical, non-critical, etc.) with a description of the services provided. The risk rating dictates the frequency (and the corresponding level of detail) of ongoing due diligence reviews by management. In rating risk, management should consider sensitivity of data accessed or controlled by the service provider. If a vendor has access to any sensitive information (member, employee, or credit union), stronger oversight is appropriate. Management should verify that third-party service providers implement and maintain sufficient controls to mitigate risks.

Although some credit unions outsource third party due diligence and monitoring, compliance with the credit union’s vendor management program remains the responsibility of credit union management.

Contracts
Contracts are the means for credit union management to require its service providers to implement appropriate measures designed to meet the objectives of regulatory guidelines for safeguarding member information (GLBA guidelines).

Contract considerations:
	• Timeframe
	• Details of the service or product to be provided
	• Adequate and measurable service level agreements (SLAs)
	• Compliance with all applicable laws, regulations, and regulatory guidance
	• Third party insurance coverage
	• Subcontractor clauses (permissibility, impermissibility)
	• Right to audit
	• Independent validation of security controls
	• Confidentiality and security of information, including provision for prompt return or destruction of the credit union''s data
	• Notification of any information security or business continuity incident in a timely manner.' WHERE [Mat_Question_Id] = 7602
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Fact]=N'Disruptions resulting from cyber events, natural disasters, or man-made events can interrupt a credit union’s operations and can have a broad impact on the financial sector. Business continuity management (BCM) is the process of planning for continuity of operations in the case of disaster. BCM addresses resilience, continuity, and a credit union’s response capability to safeguard employees, customers, and products and services. 

A credit union’s BCM program should align with its strategic goals and objectives. A BCM program has multiple components, including:
	• Business Impact Analysis (BIA)
	• Business Continuity Plan (BCP)
	• Backup and Recovery Plan
	• Testing

Business Impact Analysis (BIA): 
Management should develop a BIA that identifies all business functions and prioritizes them in order of criticality, analyzes related interdependencies among business processes and systems, and assesses a disruption’s impact through established metrics. The BIA should estimate a recovery time objective (RTO) and recovery point objective and define recovery priorities and resource dependencies for critical business processes. Ideally, RTOs are derived from a business impact analysis or similar effort to estimate the cost of downtime over various timeframes (short, medium, and longer term). If critical activities cannot be recovered within the defined RTO, the credit union should establish alternative processes to resume critical activities.

Business Continuity Plan (BCP):
The credit union should have a board-approved business continuity, disaster recovery, and data backup program to recover operations following an incident. The BCP should address:
	• BIA and risk assessment.
	• Alternate processing for critical business functions while systems/applications and facilities are unavailable.
	• Recovery strategies and procedures for critical systems/applications.
	• Roles and responsibilities; and
	• BCP and disaster recovery testing.
	
A backup and recovery plan describes how critical systems are backed up and restored. Critical systems'' data is typically backed up at least daily, and recovery from backups should be tested periodically to verify the backup process is functioning properly.

The BCP focuses on critical business functions and varies according to the credit union’s size and complexity. The BCP includes specific elements, such as incident response, disaster recovery, and crisis management. Smaller credit unions may have a single BCP that includes these elements. Large, complex credit unions may have multiple plans specific to business functions, locations, or departments. 

A comprehensive plan based on FFIEC’s BCP booklet would include:
	• Roles, responsibilities, and required skills for credit union personnel and third-party service providers
	• Solutions to various types of foreseeable disruptions (for example, fires, floods, etc.) including disruptions caused by cyber threat actors
	• Escalation thresholds
	• Immediate steps to protect personnel and customers and minimize damage
	• Prioritization and procedures to recover functions, services, and processes
	• Critical information protection (for example, physical, electronic, hybrid, and use of off-site storage)
	• Alternate site plans including logistical arrangements (for example, housing, transportation, or food) for personnel at the recovery locations</li>
	• Network equipment, connectivity, and communication needs, including credit union-owned and personal mobile devices
	• Personnel at alternate sites, including arrangements for those permanently located at the alternate facility
	• Scope and frequency of testing
	• Pandemic plans
	• Resumption of a normalized state for business processes

The BCP should be a living document, regularly updated so that it remains current with system enhancements and organizational changes.

Testing:
The BCP plan should require testing at a set frequency to validate the effectiveness of the credit union’s BCP and identify deficiencies. Exercises and tests help validate a credit union’s ability to restore critical business functions quickly. They also confirm that critical business functions are resilient and can maintain continuity. There are many types of exercises, depending on the intended goals and objectives. Exercises may include scenario-driven simulations of BCP elements. For example, exercises may include performing duties in a simulated environment (in other words, functional testing) or be discussion based (in other words, tabletop exercises). Testing should encompass internal and external dependencies, including activities outsourced to third-party service providers. A credit union does not need to test all systems simultaneously but should follow a comprehensive rotation of testing to cover all essential systems.

Third-party service providers deliver critical services to many credit unions and should be included in the enterprise-wide exercise and testing program. A third party’s inclusion in the credit union’s BCP should becommensurate with the criticality of the third-party service provider and its involvement in the business function.' WHERE [Mat_Question_Id] = 7607
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Fact]=N'Anti-Virus/Anti-Malware:
Because anti-virus alerts are computer incidents and potential indicators of a network compromise, management needs to ensure they are investigated and resolved. Management should require the IT function to:
	• Install anti-virus/anti-malware on all desktops, laptops, and servers.
	• Deploy signature updates automatically.
	• Send notifications when a virus is detected; and
	• Make reports or dashboards available for review.

In instances where anti-virus protection cannot be deployed, management should identify and implement mitigating measures based upon the credit union''s risk assessment. Anti-malware reports can be compared to asset inventory reports to verify all devices are included.

Email filtering:
Email is inherently insecure. A credit union''s email can be subject to interception, alteration, and counterfeiting by anyone on the virtual path between the sender and the recipient.

The National Institute of Standards and Technology (NIST) defines spam as electronic junk mail or the abuse of electronic messaging systems to indiscriminately send unsolicited bulk messages. Blocking spam messages is the first line of defense to protect e-mail users from malicious file attachments and links.

Credit unions protect themselves from malicious code by deploying anti-virus, anti-spyware, and anti-spam filtering, and by blocking the ability to download executable files.

Email Encryption:
When sending sensitive documents or emails, a credit union should consider encrypting those documents and/or emails. Many document and email applications provide this capability. Typically, the receiver will need to have the same application to de-crypt the message or document as used to encrypt it. If you need to send a recipient a password or key, give it to them via phone or other method. Never send a password or key in the same email as the encrypted document.

Patch Management:
Patch Management is an easy concept to understand, but a challenge to execute. Patch management is the process of identifying, acquiring, installing, and verifying patches for products and systems. Patches correct security and functionality problems in software and firmware. Patch management is required by various security compliance frameworks, mandates, and other policies. For example, NIST Special Publication (SP) 800-532 establishes the SI-2, Flaw Remediation security control, which includes: 
	• Installing security-relevant software and firmware patches,
	• Testing patches before installing them, and 
	• Incorporating patches into the organization''s configuration management processes.

Another example is the Payment Card Industry Data Security Standard, which requires installing the latest patches and sets a maximum timeframe for installing the most critical patches.

Vendors routinely issue patches or security updates to address vulnerabilities found on institutions systems. Best Practice CIS Safeguard 7.4 recommends monthly updates at a minimum. The latest patches should be deployed to critical systems as soon as possible. If critical patches are not applied promptly, a hacker could exploit these vulnerabilities to access sensitive data. An effective patch management plan will include:
	• A patching schedule,
	• Expected timeframes for applying patches based on
		- criticality
		- risk
		- testing environment
	• A reporting function that covers which patches have and have not been applied.

When feasible, credit unions should test software and firmware updates before full deployment into production systems. This enables them to identify potential compatibility and instability issues that could cause serious operational disruptions.

Keeping up with
patches is challenging to manage even for less complex credit unions. Management should implement automated patch management systems and software to protect all network components, including servers, virtual machines, routers, switches, mobile devices, and firewalls, with appropriate updates. Some systems may be manually patched.

Patch management
solutions can produce a variety of reports, including patch compliance, exceptions, and days outstanding. Missing critical patches to servers, desktops, laptops, and other devices should be remediated as soon as possible unless there is an approved exception. If patch management is outsourced to a vendor, then the vendor should provide patch status reports to the credit union’s management.

Vulnerability scans help detect vulnerabilities for which there are patches available that may have been missed by the credit union’s patch management program and processes.

Passwords:
Strong passwords help mitigate credential guessing and cracking. Password complexity is determined by length and the combination of unpredictable characters. According to Best Practice CIS Safeguard 5.2 (Use Unique Passwords), implementation should include a minimum password of 8 characters for accounts using MFA and 14 characters for accounts not using MFA. Delete or disable any inactive accounts after a period of 45 days of inactivity, where supported.

Access controls also include limiting the number of password attempts—typically three—before a user is locked out. Controls also prohibit the reuse of passwords. This means users are not allowed to enter a new password based on alteration of one character. Instead the system requires an entirely new character string.

The NIST 7621, Small Business Information Security, The Fundamentals, provides the following information regarding the use of strong passwords:

For systems or applications that have important information, use multiple forms of identification (called “multi-factor” or “dual factor” authentication). For example, when a user logs in with a password, they may be sent a text message with a code they have to enter as well. Biometrics (e.g. fingerprint scanners) and other devices may be used but can be expensive and difficult to install or maintain.

Many devices come with default administration passwords – these should be changed immediately when installing and regularly thereafter. Default passwords are easily found or known by hackers and can be used to access the device. The manual or those who install the system should be able to show you how to change them.

Passwords to devices and
applications that deal with business information should not be re-used. If a hacker gains access to one account, they will have access to all others that share that password. It may be difficult to remember a number of different passwords so a password management system may be an option. However, these systems place all passwords into one place which may be lost or compromised. Carefully compare password management solutions before purchasing.

Passwords are often the only barrier protecting your personal information. There are several techniques attackers can use to help guess or "crack" passwords. However, choosing strong passwords and keeping them confidential can make it more difficult for others to access information.

Passwords that do not change for long periods of time allow hackers time to crack them and may be shared and become common knowledge to an individual user’s coworkers. Therefore, passwords should be changed at least every three months. If possible, consider configuring systems and devices to require users to change their passwords every three months.

NCCIC/US-CERT recommends users take the following actions:
	• Use multi-factor authentication when available
	• Use different passwords on different systems and accounts
	• Don''t use passwords that are based on personal information that can be easily accessed or guessed
	• Use the longest password or passphrase permissible by each password system
	• Don''t use words that can be found in any dictionary of any language' WHERE [Mat_Question_Id] = 7612
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Fact]=N'
A credit union''s written information security program must be designed to:
    <ol>
        <li>• Ensure the security and confidentiality of member information.</li>
        <li>• Protect against any anticipated threats or hazards to the security or integrity of such information.</li>
        <li>• Protect against unauthorized access to or use of such information that could result in substantial harm or inconvenience to any member; and</li>
        <li>• Dispose of member information and consumer information properly.</li>
    </ol>
</p>

The board or the board committee oversees the credit union’s information security program. This oversight includes reviewing and approving information security policies as required by the Gramm Leach Bliley Act (GLBA) guidelines. The board’s approval of the credit union’s information security policies and program should be noted in meeting minutes of the entity responsible for overseeing the Information Security Program—either the board or a designated committee of the board.
</p>

<b>Policies:</b> Management establishes policies, standards, and procedures to support the information security program. Appropriate policies, procedures, and standards will reflect the complexity of the IT environment. 
</p>

<span>Policies, standards, and procedures guide the decisions and activities of users, developers, administrators, and managers and inform those individuals of their information security responsibilities. </span>The <b>policy</b> should establish the requirements, rules, or guiding principles that govern the information security program. Credit unions typically have a high-level Information Security Policy that meets the GLBA requirements that the board approves, and standards or guidelines that outline the expectations and technical requirements for the credit union’s information security program. <b>Procedures</b> usually define the processes that meet requirements of the policy and standards. <span></span>
</p>

<span>A credit union’s </span>written program should reflect the actual practices at the credit union, it isn’t enough to rely on templates provided by third parties.
</p>

An information security program should outline expectations in the following areas:
    <ol>
        <li>• Roles and responsibilities,</li>
        <li>• Requirement for a risk assessment,</li>
        <li>• Logical and physical access controls, authentication controls,</li>
        <li>• Encryption of data in transit and in storage,</li>
        <li>• Dual controls expectations, segregation of duties,</li>
        <li>• Monitoring Systems,</li>
        <li>• Incident Response Program,</li>
        <li>• Training Program,</li>
        <li>• Testing Program,</li>
        <li>• Patch and Change Management program,</li>
        <li>• Data disposal, and</li>
        <li>• Business Continuity and Disaster Recovery Planning.</li>
    </ol>
</p>

<b>Authentication and access controls requirements:</b> Policies and standards should define the identification and authentication requirements before access is granted to critical systems, such as core, network, and other applications and systems. Authentication requirements should include minimums for password strength, such as password length, defined character combinations, and the use of passphrases and Multi-Factor Authentication (MFA) where applicable. A passphrase is a series of words or other text that is generally longer than a  traditional password. 
</p>

Finally, the information security policy should outline the frequency and other requirements for independent testing of controls.
</p>' WHERE [Mat_Question_Id] = 7619
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Fact]=N'
To comply with GLBA guidelines, management should report at least annually to the board or responsible committee of the board on the status and effectiveness of the information security program. This report should:
<ul>
	<li>• Describe the overall status of the information security program</li>
	<li>• Address the credit union''s compliance with established guidelines</li>
	<li>• Discuss material matters related to its program, addressing security concerns that include: 
		<ul><li>- risk assessment — the results of the completed information security risk assessment should be reported to the board.</li></ul></li>
	<li>
		<ul><li>- risk management and control decisions — any changes to the credit union’s security controls, posture, or risk tolerance, and any acceptance of risk.</li></ul></li>
	<li>
		<ul><li>- service provider arrangements — information on the vendor management program, such as the breakdown of vendors by criticality, status of due diligence, any vendor concerns, or new vendors hired.</li></ul></li>
	<li>
		<ul><li>- results of testing — any issues identified in the external audits and assessments, including the status of remediation.</li></ul></li>
	<li>
		<ul><li>- security breaches — any breaches or violations and management’s responses to these incidents should be covered in the reported period; and </li></ul></li>
	<li>
		<ul><li>- recommendations — for changes to the information security program.</li></ul></li>
</ul></p>' WHERE [Mat_Question_Id] = 7628
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Fact]=N'An asset inventory process includes a comprehensive report or listing of a credit union’s hardware (for example, physical, and virtual servers, operating systems, and business applications), portable and mobile  devices, and other network equipment. Reporting should also include the credit union’s software assets, identifying the device type and software version to  help the credit union manage software updates and patches. Management should  keep this inventory current and accurate and have an independent source periodically validate its accuracy.</p><p class="MsoNormal">Institutions cannot protect and monitor assets that they  don’t know they have. Unmanaged or unauthorized devices can become targets for  attack against the institution. Accurate inventories assist management with  cyber risk and recovering from and responding to incidents. Maintaining an  asset inventory is an ongoing process. Smaller or less complex entities may use  informal methods (for example, spreadsheets) to track IT assets. Larger or more  complex entities may use automated tools to assist with IT asset management. Automated tools serve a variety of functions, such as logging and vital asset  statistics. Some automated tools alert management when a new or unapproved  device is connected to the credit union’s network. </p><p class="MsoNormal">Management should keep the inventory list updated and remove  unauthorized assets. Anything connected to the network with an IP address  should be included in the inventory, including virtual hardware. </p><p class="MsoNormal">At a minimum, the Hardware asset inventory should include  the following data:
	• Network (IP) Address
	• Machine Name
	• Vendor and model
	• Operating System
	
Additional information in this area is provided in the FFIEC  IT Booklet “Architecture, Infrastructure, and Operations.” The Software Inventory typically includes:
	• Application/software name
	• Version
	• Manufacturer
	• Number of installations
	• Software Type

Without a complete and accurate software inventory, institutions cannot identify any vulnerable software, or software that may create a potential security risk. Additionally, management should establish an approved or authorized software list. Unauthorized software programs can be  limited to specific versions or from a specific source. Unauthorized software should be investigated and removed.

Management should establish clear accountability for the oversight of the asset inventory. <b>Best practice</b> <b>CIS Safeguard 2.1</b>  recommends reviewing and updating the software inventory bi-annually, or more frequently. For any unsupported software, management should document approved exceptions. Documentation should include any mitigating controls and the risk acceptance process.' WHERE [Mat_Question_Id] = 7633
