UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Fact]=N'A well-planned, properly structured audit program is essential to evaluate risk management practices, internal control systems, and compliance with corporate policies concerning IT-related risks at institutions of every size and complexity. Effective audit programs are risk-focused and promote sound IT controls across the credit union. To determine what risks exist, management should prepare an independent assessment of the credit union''s risk exposure and the quality of the internal controls associated with the development, acquisition, implementation, and use of information technology (i.e., new products, services, and delivery channels).

An effective audit program evaluates risk management practices, internal control systems, and compliance with corporate policies concerning IT-related risks. Cybersecurity controls are an integral part of the credit union''s information security control environment and like all control systems, independent audit is responsible for validating that they are effective and commensurate with the credit union''s risk profile.

Institutions should have an audit schedule that includes frequency of an independent, periodic (typically an annual) IT General Controls audit, internal and external vulnerability scanning, internal and external penetration testing, and social engineering testing based on risk.

IT Audit:
The majority of institutions outsource IT audits to third parties. A general IT controls audit typically covers IT governance, policies and procedures, vendor management, access controls, change management, BCP, and other areas depending on the scope of the audit. 

Vulnerability Scans:
All institutions should have periodic independent external and internal vulnerability scans/assessments. Scans discover vulnerabilities on the internal network and externally facing assets. Organizations employ network scanning tools to identify and prevent the use of prohibited functions, protocols, ports, and services. If not remediated, weaknesses on the network can be exploited by a bad actor to compromise computer systems. The scanning can be done with an appliance placed on the network that automatically scans assets at predetermined intervals or can be completely outsourced to third parties. If the scanning is done internally by IT staff not independent of the process, then management should engage an independent third party to validate and confirm internal results at least annually. </p><p class="MsoNormal"><b>Penetration Testing:</b> A penetration test attempts to exploit discovered vulnerabilities by using various custom tools or scripts and includes more analysis. Penetration testing is performed by a qualified independent third party. <b>Best practice CIS Safeguards 18.5</b> recommends at least an annual testing.

Social Engineering Testing:
This includes phishing testing, vishing calls or text, or physical social engineering. Phishing testing is often done internally using a vendor platform and validated periodically by an independent third party. Vishing and physical social engineering tests are typically done every other year or more frequently based on risk.' WHERE [Mat_Question_Id] = 7645
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Fact]=N'Proper remediation of material weaknesses is a basic and essential component of effective audit oversight. Credit union management should establish a formal tracking process to monitor remediation progress and a reporting process that documents responsibility. The results of the reporting process should be shared with management frequently.

Typically, a tracking report includes the following: 
	• Issue or finding,
	• Date Discovered,
	• Target Resolution Date,
	• Party Responsible,
	• Periodic Status updates, and
	• Date Resolved.

Internal Audit or the Supervisory Committee should:
	• Identify weaknesses,
	• Review management''s plans for addressing those weaknesses, 
	• Monitor resolution, and 
	• Report to the board as necessary on material weaknesses. 
	
The board, supervisory committee, and/or audit committee meeting minutes should reflect monitoring and status updates for all audit findings. The timing of the resolution should be commensurate with the criticality of the finding.' WHERE [Mat_Question_Id] = 7652
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Fact]=N'A credit union should establish an organization-wide information security awareness training program to address threats and inform employees about information security controls and the employees’ information security responsibilities. The training program should consider evolving and persistent cyber-threats, including: 
	• phishing,
	• social engineering,
	• DDoS,
	• account takeover,
	• ransomware, and
	• any emerging issues. 

Training should include annual certification that personnel understand their responsibilities. In addition, new employees should receive training shortly after they are onboarded. 

The information security awareness training program should support policy awareness and compliance and be updated frequently to address the various types of cyber-threats by describing the threats, attack vectors, and potential impact on the credit union''s systems and members.

Best practices CIS Safeguards 14.6 instructs institutions to also train employees in recognizing and reporting a potential incident.

A credit union should validate the effectiveness of their security awareness training program by employing techniques such as faux phishing campaigns or social engineering exercises. The results of these exercises can help a credit union identify areas of focus to provide additional training. Frequent testing of employees on various types of social engineering tactics helps to keep them prepared and vigilant for such attacks.

The key objective for any security awareness training program should be shaping employee behavior to reduce the likelihood and impacts of security incidents. Outcome-driven metrics ties training back to measurable protection benefits. Management should track and evaluate the results from the security awareness training program and maintain records of completed training for all employees.

Members also benefit from information security awareness. For example, credit unions can use their website to educate customers about current cyber threats and methods used to illegally access accounts and account information, such as phishing, social engineering, mobile-based trojans, and business email compromise.' WHERE [Mat_Question_Id] = 7655
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Fact]=N'Per Interagency Guidance on Response Programs for Unauthorized Access to Customer Information and Customer Notice, each institution should have a risk-based response program to address unauthorized access to customer information. The incident response program should be appropriate to the size and complexity of the credit union and its information security risks. 

At a minimum, a credit union''s response program should outline procedures to: 
	• Assess the nature and scope of an incident and identifying what member information systems and types of member information have been accessed or misused.
	• Contain and control incidents to prevent further unauthorized access to or use of member information. These should list which personnel is responsible for taking these steps.
	• Prepare, detect, contain, eradicate, remediate, and follow-up on incidents. Each phase of the incident handling should list steps or procedures to follow.
	• Notify law enforcement, insurers, regulators, other incident response vendors, and members. These procedures should include applicable regulatory timeframes, as well as who to notify (for example which law enforcement agencies), and when to file a Suspicious Activity Report (SAR).
	• Address a third-party service provider incident, including defining the related notification responsibilities. The response program should designate an incident response team and include roles and responsibilities for team members. The program should include standards for timely notification to members and outline components of the member notice. 
	
Member notice components should be provided in plain language and include:
	• Incident description
	• Type of member information compromised
	• How the credit union will prevent further unauthorized access
	• Informational phone number
	• Reminder to members to remain vigilant over next 12-24 months
	• Request to report ID theft to CU promptly' WHERE [Mat_Question_Id] = 7661
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Fact]=N'Credit unions have increasingly developed third party relationships to meet strategic objectives and enhance member services. Properly managed and controlled third party relationships provide a wide range of potential benefits to credit unions and their members. Many credit unions have utilized third party arrangements to gain expertise, realize economies of scale, or even reach new members. Leveraging the talents and experience of third parties can assist credit unions in meeting their members’ needs while accomplishing their strategic goals. In some cases, third party relationships are critical to the on-going success of a credit union. 

By taking the time to properly evaluate and cultivate third party arrangements, credit unions can experience a high degree of success. Prudent credit unions will conduct thorough due diligence and evaluate any third-party contracts carefully.

Credit unions use due diligence to determine whether the risks undertaken in a third-party relationship are acceptable in relation to their risk profile and safety and soundness requirements. Less complex risk profiles and third-party arrangements typically require less analysis and documentation. Management may rely on third parties to provide critical services but remains responsible for ensuring the confidentiality, integrity and availability of the credit union’s systems and information. Through oversight, a credit union monitors the effectiveness of the services provided by third parties.

Credit unions should only enter into service provider contracts that have appropriate information security measures. The contract should be clear about information security roles and responsibilities and outline the appropriate actions to address incidents of unauthorized access to or use of the credit union''s member information. The contract should clearly require timely notification to the credit union of any incidents.</p><p class="MsoNormal">When evaluating third party arrangements, examiners verify the credit union has addressed the following concepts appropriately for its size, complexity, and risk profile:
	• Risk Assessment and Planning.
	• Due Diligence; and
	• Risk Measurement, Monitoring and Control.
	
Vendor List
Management should maintain a current listing of all third-party service providers by risk rating/criticality (high, medium, low risk OR critical, non-critical, etc.) with a description of the services provided.&nbsp; The risk rating dictates the frequency (and the corresponding level of detail) of ongoing due diligence reviews by management. In rating risk, management should consider sensitivity of data accessed or controlled by the service provider. If a vendor has access to any sensitive information (member, employee, or credit union), stronger oversight is appropriate. Management should verify that third-party service providers implement and maintain sufficient controls to mitigate risks. 

Although some credit unions outsource third party due diligence and monitoring, compliance with the credit union’s vendor management program remains the responsibility of credit union management.

Contracts
Contracts are the means for credit union management to require its service providers to implement appropriate measures designed to meet the objectives of regulatory guidelines for safeguarding member information (GLBA guidelines). Contract considerations:
	• Timeframe
	• Details of the service or product to be provided
	• Adequate and measurable service level agreements (SLAs)
	• Compliance with all applicable laws, regulations, and regulatory guidance
	• Third party insurance coverage
	• Subcontractor clauses (permissibility, impermissibility)
	• Right to audit
	• Independent validation of security controls
	• Confidentiality and security of information, including provision for prompt return or destruction of the credit union''s data
	• Notification of any information security or business continuity incident in a timely manner.' WHERE [Mat_Question_Id] = 7669
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Fact]=N'Disruptions resulting from cyber events, natural disasters, or man-made events can interrupt a credit union’s operations and can have a broad impact on the financial sector. Business continuity management (BCM) is the process of planning for continuity of operations in the case of disaster. BCM addresses resilience, continuity, and a credit union’s response capability to safeguard employees, customers, and products and services. 

A credit union’s BCM program should align with its strategic goals and objectives. A BCM program has multiple components, including:
	• Business Impact Analysis (BIA)
	• Business Continuity Plan (BCP)
	• Backup and Recovery Plan
	• Testing

Business Impact Analysis (BIA): 
Management should develop a BIA that identifies all business functions and prioritizes them in order of criticality, analyzes related interdependencies among business processes and systems, and assesses a disruption’s impact through established metrics. The BIA should estimate a recovery time objective (RTO) and recovery point objective and define recovery priorities and resource dependencies for critical business processes. Ideally, RTOs are derived from a business impact analysis or similar effort to estimate the cost of downtime over various timeframes (short, medium, and longer term). If critical activities cannot be recovered within the defined RTO, the credit union should establish alternative processes <span>to resume critical activities.

Business Continuity Plan (BCP):
The credit union should have a board-approved business continuity, disaster recovery, and data backup program to recover operations following an incident. The BCP should address:
	• BIA and risk assessment.
	• Alternate processing for critical business functions while systems/applications and facilities are unavailable.
	• Recovery strategies and procedures for critical systems/applications.
	• Roles and responsibilities; and
	• BCP and disaster recovery testing.
	
A backup and recovery plan describes how critical systems are backed up and restored. Critical systems'' data is typically backed up at least daily, and recovery from backups should be tested periodically to verify the backup process is functioning properly.

The BCP focuses on critical business functions and varies according to the credit union’s size and complexity. The BCP includes specific elements, such as incident response, disaster recovery, and crisis management. Smaller credit unions may have a single BCP that includes these elements. Large, complex credit unions may have multiple plans specific to business functions, locations, or departments. 

A comprehensive plan based on FFIEC’s BCP booklet would include:
	• Roles, responsibilities, and required skills for credit union personnel and third-party service providers
	• Solutions to various types of foreseeable disruptions (for example, fires, floods, etc.) including disruptions caused by cyber threat actors
	• Escalation thresholds
	• Immediate steps to protect personnel and customers and minimize damage
	• Prioritization and procedures to recover functions, services, and processes
	• Critical information protection (for example, physical, electronic, hybrid, and use of off-site storage)
	• Alternate site plans including logistical arrangements (for example, housing, transportation, or food) for personnel at the recovery locations
	• Network equipment, connectivity, and communication needs, including credit union-owned and personal mobile devices
	• Personnel at alternate sites, including arrangements for those permanently located at the alternate facility
	• Scope and frequency of testing
	• Pandemic plans
	• Resumption of a normalized state for business processes

The BCP should be a living document, regularly updated so that it remains current with system enhancements and organizational changes. 

Testing:
The BCP plan should require testing at a set frequency to validate the effectiveness of the credit union’s BCP and identify deficiencies. Exercises and tests help validate a credit union’s ability to restore critical business functions quickly. They also confirm that critical business functions are resilient and can maintain continuity. There are many types of exercises, depending on the intended goals and objectives. Exercises may include scenario-driven simulations of BCP elements. For example, exercises may include performing duties in a simulated environment (in other words, functional testing) or be discussion based (in other words, tabletop exercises). Testing should encompass internal and external dependencies, including activities outsourced to third-party service providers. A credit union does not need to test all systems simultaneously but should follow a comprehensive rotation of testing to cover all essential systems.

Third-party service providers deliver critical services to many credit unions and should be included in the enterprise-wide exercise and testing program. A third party’s inclusion in the credit union’s BCP should be commensurate with the criticality of the third-party service provider and its involvement in the business function.
' WHERE [Mat_Question_Id] = 7674
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Fact]=N'Patch management procedures and the three most recent patch management reports  for operating systems and software applications.

Patch Management is an easy concept to understand, but a challenge to execute. Patch management is the process of identifying, acquiring, installing, and verifying patches for products and systems. Patches correct security and functionality problems in software and firmware. Patch management is required by various security compliance frameworks, mandates, and other policies. For example, NIST Special Publication (SP) 800-532 establishes the SI-2, Flaw Remediation security control, which includes:
	• Installing security-relevant software and firmware patches,
	• Testing patches before installing them, and
	• Incorporating patches into the organization’s configuration management processes.
	
Another example is the Payment Card Industry Data Security Standard, which requires installing the latest patches and sets a maximum timeframe for installing the most critical patches.

Vendors routinely issue patches or security updates to address vulnerabilities found on institutions systems. Best Practice CIS Safeguard 7.4 recommends monthly updates at a minimum. The latest patches should be deployed to critical systems as soon as possible. If critical patches are not applied promptly, a hacker could exploit these vulnerabilities to access sensitive data. An effective patch management plan will include:
	• A patching schedule, 
	• Expected timeframes for applying patches based on
		- criticality
		- risk
		- testing environment
	• A reporting function that covers which patches have and have not been applied.

By testing software and firmware updates, a credit union can identify compatibility and instability issues that could cause serious operational disruptions.

Keeping up with patches is challenging to manage even for less complex credit unions. Management should implement automated patch management systems and software to protect all network components, including servers, VMs, routers, switches, mobile devices, and firewalls, with appropriate updates. Some systems may be manually patched.

Patch management solutions can produce a variety of reports, including patch compliance, exceptions, and days outstanding. Missing critical patches to servers, desktops, laptops, and other devices should be remediated as soon as possible unless there is an approved exception. If patch management is outsourced to a vendor, then the vendor should provide patch status reports to the credit union’s management.

Vulnerability scans help detect vulnerabilities for which there are patches available that may not have been installed.

Credit unions should develop a plan to continuously assess and track vulnerabilities on all enterprise assets within the enterprise’s infrastructure, to remediate and minimize a window of opportunity for attackers. Hackers will attempt to exploit these vulnerabilities to get access to the institution’s data. Management should monitor public and private industry sources for new threat and vulnerability information.' WHERE [Mat_Question_Id] = 7679
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Fact]=N'Antivirus/anti-malware protection is preventative software that detects, neutralizes, and removes malware. Using a regularly updated database of malware and viruses, it scans a device, comparing its files to the files in its database. The software also scans the device for any suspicious behaviors that could indicate malware, which allows the software to detect malware even if it’s not already in the database.

Credit union management should require the IT function to:
• Install anti-virus/anti-malware on all desktops, laptops, and servers.
• Deploy signature updates automatically.
• Send notifications when a virus is detected
• Make reports or dashboards available for review.

Any devices excluded from malware protection should be documented and approved by management. All end-point devices should be protected. The reports can be compared to asset inventory reports to ensure all devices are included. An antivirus scan report provides details on the antivirus (AV) scans run on selected endpoints or endpoints in a selected group within the specified report. The details include the type of scan, scan duration, malware that are detected and action taken on each identified threat. The latest tools provide behavior-based anti-malware as compared to signature-based. New forms of malware can only be detected by behavior-based detection mechanisms.

Antivirus and anti-malware tools help protect data and systems by detecting malicious code or malware to include viruses, Trojans, rootkits, and destructive malware. Having antivirus and malware protection on systems, desktops, laptops, and other devices is critical given today''s threats. IT staff should provide status reports to the IT committee or management confirming that devices are up to date.' WHERE [Mat_Question_Id] = 7683
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Fact]=N'Credit unions should establish and follow a formal process for granting access to enterprise assets when hiring a new employee, or when an employee changes roles. Credit unions should also establish and follow a formal process for revoking access to enterprise assets, including disabling accounts immediately upon termination. Disabling accounts instead of deleting them may be necessary to preserve audit trails. Formalized processes include supporting policies or procedures and tracking of user access change requests via IT ticketing systems and/or change request forms.

Best practices:
CIS Safeguards 5.2 Use Unique Passwords: Implementation includes, at a minimum, an 8-character password for accounts using MFA and a 14-character password for accounts not using MFA. Delete or disable any inactive accounts after a period of 45 days of inactivity, where supported.

NIST 7621, Small Business Information Security, The Fundamentals: Good passwords consist of a random sequence of letters (upper case and lower case), numbers, and special characters, and are at least 12 characters long. For systems or applications that have important information, use multiple forms of identification (called MFA or “dual factor” authentication). For example, when a user logs in with a password, they may be sent a text message with a code they have to enter as well. Biometrics, such as fingerprint readers, and other identification devices may be used but can be expensive and difficult to install or maintain.

Microsoft Best practices for Windows 10 includes a minimum 14-character password as noted here.

NIST Digital Identity Guidelines 800-63-3 defines MFA: An authentication system that requires more than one distinct authentication factor for successful authentication. Multi-factor authentication (MFA) can be performed using a multi-factor authenticator or by a combination of authenticators that provide different factors.

The three type of factors are:
• Something you know — a password or personal identification number
• Something you have—an ID badge, token, or a cryptographic key
• Something you are—a fingerprint or other biometric data

Additional resources in this area include FFIEC Guidance “Authentication and Access to Financial Institution Services and Systems”.

CIS Safeguards 6.4 and 6.5 also establishes MFA for remote access and all privileged or administrator accounts.' WHERE [Mat_Question_Id] = 7687
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Fact]=N'A credit union''s network perimeter enables or restricts connection to, and communication with, the internet. To control network traffic, the credit union should use devices such firewalls to restrict and filter traffic. A firewall is a network device or application that prevents unauthorized access either to or from trusted and untrusted networks. A credit union or its service provider should establish specific firewall rules that either allow or deny inbound and outbound traffic and access to the network.

Intrusion detection systems (IDS) or intrusion prevention systems (IPS) help identify unusual activity by analyzing network traffic and sending alerts, and in the case of IPS, blocking traffic from entering the network. While both <b>IDS</b> and ISP can typically alert personnel to potential attacks, <b>IPS</b> can be configured to block activity or take other action predefined by management. Next Generation Firewalls include advanced threat detection with IPS, if correctly configured by staff. The tools alone cannot be effective if they are not continually monitored for anomalous activity. Institutions may have firewall management outsourced to a third party or monitored internally. Third party service providers should provide regular reports on the firewall and IDS/IPS monitoring. Additionally, a credit union should review its firewall rules periodically.

The network topology diagram(s) can be used to determine firewall, IDS, and IPS placement on the network.' WHERE [Mat_Question_Id] = 7691
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Fact]=N'Email and web vectors open opportunities for attackers to manipulate human behavior through direct engagement. Third parties periodically release security updates for browsers. The upgrades typically address vulnerabilities that an attacker could exploit to take control of an affected system. Browsers should be updated to the most current version as soon as possible and only supported browsers should be used.

Additional controls include:
• Enforcing and updating network-based URL filters to limit a credit union computer from connecting to potentially malicious or unapproved websites, 
• Deploying anti-malware protection solutions to protect the email system
• Blocking unnecessary file types with extensions with .ade, .adp, .app, exe, .jsp, .iso, .jar, and many more. 

URL filtering may include category-based filtering, for example: entertainment, social media, adult material, and others. It can also include reputation-based filtering, for example: IP blocking by geographic region, or by using a block list. Credit unions typically have multiple filtering policies applied based on either departments or specific employee groups. These web-filtering policies or rules should be reviewed periodically to ensure they are relevant and necessary based on business needs.

Using a spam-filtering tool and malware scanning at the email gateway reduces the number of malicious emails and attachments. Cyber threat actors use phishing and business email compromise (as noted in the CIS Safeguards and NCUA Risk Alert 19-RISK-01) to exploit employee access to protected systems. Credit unions should implement recommended controls for email service, such as anti-phishing, anti-spam and anti-malware.

Unnecessary file types increase the risk of a malware compromise. One recent study found that 95% of ransomware samples were Windows-based executable files. Malware often relies on insecure end-user behavior, such as opening attachments.' WHERE [Mat_Question_Id] = 7694
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Fact]=N'Change management is a process designed to understand and minimize risks while making IT changes. The objective of change management is to support IT service management as it implements rapid change while minimizing the possibility of disruption to services. Changes can potentially have significant impact on the security of the systems, therefore written standards and procedures should guide the process of introducing changes and defining requirements. Credit unions should have a documented process to procure and implement applications and system changes to hardware, software, operating systems and other areas. Changes can be complex (core conversion, moving to cloud), or routine (deploying a patch), but all changes should follow a formal change management process.

The written policy and procedures should address:
• Types of changes
• Risk and impact
• Testing
• Authorization and approval
• Timing of implementation
• Post installation validation
• Back-out or recovery
• Notifications if necessary
• Oversight

The FFIEC IT Handbook “Architecture, Infrastructure, and Operations” provides more details on this process:

Change Request: A documented request should outline the reasons for the change and include the details described in the list below.
• Authorization and approval: Approval may be granted by IT management, a formal change committee, the IT steering committee, or other designated personnel. Approval decisions should be based on the overall risk of the change to IT environment.
• Test and Implementation: Management should document that the change performs as intended, identify any flaws (e.g., integrity issues), and verify that the change integrates with other systems. Management should also follow a formal process to deploy the change during off peak hours or planned system outages.
• Post installation validation: After deploying change, management should validate that the change was implemented successfully and close the change.

It’s important to include all steps in the change process. If changes are not properly approved and tested before implementation, the system may crash or experience glitches that may affect users of the system. Some of the changes performed frequently or routinely may be pre-approved, such as patch installation. When there is an ongoing cyber event or critical risk, other changes like emergency patches or updates may be reviewed and approved after the fact. Policy and procedures should also address emergency change process.

A typical change management request for user access should include:
• The request itself
• The business purpose or need
• The person who reviewed it
• The person who authorized/denied it
• How long the access is needed

Additionally, user transitions should trigger a change request to review or remove permissions and access to information as staff leave or transition within the credit union.

A change request form should include:
• Change type
• Implementation timeframe
• Risk assessment
• Impact assessment
• Security considerations
• Business continuity considerations and impacts
• Dependencies
• Testing procedures and results
• Back-out procedures, and 
• Approvals' WHERE [Mat_Question_Id] = 7699
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Question_Text]=N'Procedures are documented to identify how systems are monitored for intrusions' WHERE [Mat_Question_Id] = 7704
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Supplemental_Fact]=N'Review the contract for the core conversion and assess the services the vendor is providing for the core conversion. Examiners should review the project minutes and plan for the core conversion to ensure a formal process is being followed. When reviewing the post conversion notes, examiners should look to see if there are any material concerns after the end of the project such as the need for additional software, failure to work with existing software, or data errors. Check to see if staff received or needed to receive formal training on the new system.

Review the project minutes and plan for the core conversion.' WHERE [Mat_Question_Id] = 7890
