INSERT INTO [dbo].[MATURITY_QUESTIONS] ([Mat_Question_Id], [Question_Title], [Question_Text], [Supplemental_Info], [Category], [Sub_Category], [Maturity_Level_Id], [Sequence], [Maturity_Model_Id], [Parent_Question_Id], [Ranking], [Grouping_Id], [Examination_Approach], [Short_Name], [Mat_Question_Type], [Parent_Option_Id], [Supplemental_Fact], [Scope], [Recommend_Action], [Risk_Addressed], [Services], [Outcome], [Security_Practice], [Implementation_Guides]) VALUES (8503, N'IT/SD.1', N'', NULL, NULL, NULL, 1, 1, 20, NULL, NULL, 565, NULL, NULL, NULL, NULL, NULL, N'All software development environments', N'<p>All software development environments should be logically separated from each other and enforced via controls such as network segmentation and access controls.</p>', N'Reduce the risk of lateral movement or privilege escalation between development and sensitive business environments.', NULL, N'All environments used in software development, including development, build, 
test, and distribution environments, are separated from each other to prevent unauthorized access to sensitive data and systems.', N'Separate all environments used in software development', NULL)
INSERT INTO [dbo].[MATURITY_QUESTIONS] ([Mat_Question_Id], [Question_Title], [Question_Text], [Supplemental_Info], [Category], [Sub_Category], [Maturity_Level_Id], [Sequence], [Maturity_Model_Id], [Parent_Question_Id], [Ranking], [Grouping_Id], [Examination_Approach], [Short_Name], [Mat_Question_Type], [Parent_Option_Id], [Supplemental_Fact], [Scope], [Recommend_Action], [Risk_Addressed], [Services], [Outcome], [Security_Practice], [Implementation_Guides]) VALUES (8504, N'IT/SD.2', N'', NULL, NULL, NULL, 1, 2, 20, NULL, NULL, 565, NULL, NULL, NULL, NULL, NULL, N'All software development environments', N'<p>Perform a review of all software development environments and tooling to verify associated logging capabilities and functions are enabled.</p>', N'Lateral movement, privilege escalation, insider threats, data exfiltration.', NULL, N'All software development environments and tooling have associated logging and monitoring mechanisms.', N'Regularly log, monitor, and review trust relationships used for authorization and access across software development environments', NULL)
INSERT INTO [dbo].[MATURITY_QUESTIONS] ([Mat_Question_Id], [Question_Title], [Question_Text], [Supplemental_Info], [Category], [Sub_Category], [Maturity_Level_Id], [Sequence], [Maturity_Model_Id], [Parent_Question_Id], [Ranking], [Grouping_Id], [Examination_Approach], [Short_Name], [Mat_Question_Type], [Parent_Option_Id], [Supplemental_Fact], [Scope], [Recommend_Action], [Risk_Addressed], [Services], [Outcome], [Security_Practice], [Implementation_Guides]) VALUES (8505, N'IT/SD.3', N'', NULL, NULL, NULL, 1, 3, 20, NULL, NULL, 565, NULL, NULL, NULL, NULL, NULL, N'Software', N'<p>Require MFA (ideally phishing-resistant MFA) to access all software development environments.</p>', N'Initial access, privilege escalation, lateral movement, code misconfigurations, outdated code dependencies', NULL, N'Users are required to authenticate into software development environments with MFA.', N'
Enforce MFA across software development environments', NULL)
INSERT INTO [dbo].[MATURITY_QUESTIONS] ([Mat_Question_Id], [Question_Title], [Question_Text], [Supplemental_Info], [Category], [Sub_Category], [Maturity_Level_Id], [Sequence], [Maturity_Model_Id], [Parent_Question_Id], [Ranking], [Grouping_Id], [Examination_Approach], [Short_Name], [Mat_Question_Type], [Parent_Option_Id], [Supplemental_Fact], [Scope], [Recommend_Action], [Risk_Addressed], [Services], [Outcome], [Security_Practice], [Implementation_Guides]) VALUES (8506, N'IT/SD.4', N'', NULL, NULL, NULL, 1, 4, 20, NULL, NULL, 565, NULL, NULL, NULL, NULL, NULL, N'Software', N'<p>Document processes, policies, and procedures for managing risks of software products used across software development environments. </p><p></p><p>Maintain, replace, and remove software in accordance with policies, processes, and procedures.</p><p></p><p>Assess the authenticity and integrity of software prior to use in environments.</p>', N'Misconfigurations, Shadow IT, supply chain vulnerabilities, insecure code', NULL, N'Organizations have defined processes, policies, and procedures for managing risks of software products used across software development environments.', N'Establish and enforce security requirements for software products used across software development environments', NULL)
INSERT INTO [dbo].[MATURITY_QUESTIONS] ([Mat_Question_Id], [Question_Title], [Question_Text], [Supplemental_Info], [Category], [Sub_Category], [Maturity_Level_Id], [Sequence], [Maturity_Model_Id], [Parent_Question_Id], [Ranking], [Grouping_Id], [Examination_Approach], [Short_Name], [Mat_Question_Type], [Parent_Option_Id], [Supplemental_Fact], [Scope], [Recommend_Action], [Risk_Addressed], [Services], [Outcome], [Security_Practice], [Implementation_Guides]) VALUES (8507, N'IT/SD.5', N'', NULL, NULL, NULL, 1, 5, 20, NULL, NULL, 565, NULL, NULL, NULL, NULL, NULL, N'All software development environments', N'<p>Do not store sensitive data or credentials in source code. Instead, store sensitive data and credentials in an encrypted manner, such as using a secret manager.</p><p></p><p>Securely store and rotate SSH keys.</p>', N'Lateral movement, privilege escalation, insider threats, data exfiltration', NULL, N'Organizations have eliminated the insecure storage and transmission of plaintext credentials.', N'Securely store and transmit credentials used in software development environments', NULL)
INSERT INTO [dbo].[MATURITY_QUESTIONS] ([Mat_Question_Id], [Question_Title], [Question_Text], [Supplemental_Info], [Category], [Sub_Category], [Maturity_Level_Id], [Sequence], [Maturity_Model_Id], [Parent_Question_Id], [Ranking], [Grouping_Id], [Examination_Approach], [Short_Name], [Mat_Question_Type], [Parent_Option_Id], [Supplemental_Fact], [Scope], [Recommend_Action], [Risk_Addressed], [Services], [Outcome], [Security_Practice], [Implementation_Guides]) VALUES (8508, N'IT/SD.6', N'', NULL, NULL, NULL, 1, 6, 20, NULL, NULL, 565, NULL, NULL, NULL, NULL, NULL, N'Hardware, software, and firmware', N'<p>Establish an incident response playbook with criteria for declaring incidents, along with protocols that clearly define roles, responsibilities, and identifies stakeholders who require notification.</p><p></p><p>Designate an enterprise incident response team and conduct frequent table top exercises.</p>', N'Initial access, lateral movement, command and control (C2), privilege escalation, data exfiltration, insider threats', NULL, N'The organization monitors environments to determine the presence of indicators of compromise (IOCs).  Upon determination of suspected or actual IOCs, the incident response playbook is activated.', N'Implement effective perimeter and internal network monitoring solutions with streamlined, real-time alerting to aid responses to suspected and confirmed cyber incidents', NULL)
INSERT INTO [dbo].[MATURITY_QUESTIONS] ([Mat_Question_Id], [Question_Title], [Question_Text], [Supplemental_Info], [Category], [Sub_Category], [Maturity_Level_Id], [Sequence], [Maturity_Model_Id], [Parent_Question_Id], [Ranking], [Grouping_Id], [Examination_Approach], [Short_Name], [Mat_Question_Type], [Parent_Option_Id], [Supplemental_Fact], [Scope], [Recommend_Action], [Risk_Addressed], [Services], [Outcome], [Security_Practice], [Implementation_Guides]) VALUES (8509, N'IT/SD.7', N'', NULL, NULL, NULL, 1, 7, 20, NULL, NULL, 565, NULL, NULL, NULL, NULL, NULL, N'Software', N'<p>Conduct code testing and audit software supply chain practices and document the activities conducted.</p>', N'Code tampering, outdated code dependencies, data breaches', NULL, N'Cybersecurity supply chain risk management practices are integrated into the SDLC.', N'Establish a software supply chain risk management program', NULL)
INSERT INTO [dbo].[MATURITY_QUESTIONS] ([Mat_Question_Id], [Question_Title], [Question_Text], [Supplemental_Info], [Category], [Sub_Category], [Maturity_Level_Id], [Sequence], [Maturity_Model_Id], [Parent_Question_Id], [Ranking], [Grouping_Id], [Examination_Approach], [Short_Name], [Mat_Question_Type], [Parent_Option_Id], [Supplemental_Fact], [Scope], [Recommend_Action], [Risk_Addressed], [Services], [Outcome], [Security_Practice], [Implementation_Guides]) VALUES (8510, N'IT/SD.8', N'', NULL, NULL, NULL, 1, 8, 20, NULL, NULL, 565, NULL, NULL, NULL, NULL, NULL, N'Software', N'<p>Develop a Software Bill of Materials (SBOM) and provide it to customers with each product.</p>', N'Code tampering, outdated code dependencies, data breaches', NULL, N'Customers should be provided with documentation that demonstrates component provenance.', N'Make a Software Bill of Materials (SBOM) available to customers', NULL)
INSERT INTO [dbo].[MATURITY_QUESTIONS] ([Mat_Question_Id], [Question_Title], [Question_Text], [Supplemental_Info], [Category], [Sub_Category], [Maturity_Level_Id], [Sequence], [Maturity_Model_Id], [Parent_Question_Id], [Ranking], [Grouping_Id], [Examination_Approach], [Short_Name], [Mat_Question_Type], [Parent_Option_Id], [Supplemental_Fact], [Scope], [Recommend_Action], [Risk_Addressed], [Services], [Outcome], [Security_Practice], [Implementation_Guides]) VALUES (8511, N'IT/SD.9', N'', NULL, NULL, NULL, 1, 9, 20, NULL, NULL, 565, NULL, NULL, NULL, NULL, NULL, N'Software', N'<p>Perform Static Application Security Testing (SAST), Dynamic Application Security Testing (DAST), and Software Composition Analysis (SCA) where appropriate.</p>', N'Initial access, privilege escalation, lateral movement, code misconfigurations, outdated code dependencies', NULL, N'Security testing is conducted in a codified, repeatable, and time sensitive fashion on new and current products.', N'Inspect source code for vulnerabilities through automated tools or comparable processes and mitigate known vulnerabilities prior to any release of products, versions, or update releases   ', NULL)
INSERT INTO [dbo].[MATURITY_QUESTIONS] ([Mat_Question_Id], [Question_Title], [Question_Text], [Supplemental_Info], [Category], [Sub_Category], [Maturity_Level_Id], [Sequence], [Maturity_Model_Id], [Parent_Question_Id], [Ranking], [Grouping_Id], [Examination_Approach], [Short_Name], [Mat_Question_Type], [Parent_Option_Id], [Supplemental_Fact], [Scope], [Recommend_Action], [Risk_Addressed], [Services], [Outcome], [Security_Practice], [Implementation_Guides]) VALUES (8512, N'IT/SD.10', N'', NULL, NULL, NULL, 1, 10, 20, NULL, NULL, 565, NULL, NULL, NULL, NULL, NULL, N'Software', N'<p>Develop, maintain, and execute a process or policy that governs actions to take upon identification of a security vulnerability prior to a product release.</p>', N'Initial access, privilege escalation, lateral movement, code misconfigurations, outdated code dependencies', NULL, N'Identification of vulnerabilities prior to release triggers an action to either remediate or address the vulnerability before release.', N'Address identified vulernabilities prior to product release', NULL)
INSERT INTO [dbo].[MATURITY_QUESTIONS] ([Mat_Question_Id], [Question_Title], [Question_Text], [Supplemental_Info], [Category], [Sub_Category], [Maturity_Level_Id], [Sequence], [Maturity_Model_Id], [Parent_Question_Id], [Ranking], [Grouping_Id], [Examination_Approach], [Short_Name], [Mat_Question_Type], [Parent_Option_Id], [Supplemental_Fact], [Scope], [Recommend_Action], [Risk_Addressed], [Services], [Outcome], [Security_Practice], [Implementation_Guides]) VALUES (8513, N'IT/SD.11', N'', NULL, NULL, NULL, 1, 11, 20, NULL, NULL, 565, NULL, NULL, NULL, NULL, NULL, N'Software', N'<p>Publish a vulnerability disclosure policy (VDP) that authorizes testing by members of the public on products offered by the manufacturer, commits to not recommending or pursuing legal action against anyone engaging in good faith efforts to follow the VDP, provides a clear channel to report vulnerabilities, and allows for public disclosure of vulnerabilities in line with coordinated vulnerability disclosure best practices and international standards.</p><p></p><p>Address disclosed software vulnerabilities in a timely fashion.</p>', N'Initial access, privilege escalation, lateral movement, code misconfigurations, outdated code dependencies', NULL, N'Publish a vulnerability disclosure policy that meets the defined criteria.', N'Publish a vulnerability disclosure policy', NULL)
INSERT INTO [dbo].[MATURITY_QUESTIONS] ([Mat_Question_Id], [Question_Title], [Question_Text], [Supplemental_Info], [Category], [Sub_Category], [Maturity_Level_Id], [Sequence], [Maturity_Model_Id], [Parent_Question_Id], [Ranking], [Grouping_Id], [Examination_Approach], [Short_Name], [Mat_Question_Type], [Parent_Option_Id], [Supplemental_Fact], [Scope], [Recommend_Action], [Risk_Addressed], [Services], [Outcome], [Security_Practice], [Implementation_Guides]) VALUES (8514, N'IT/PD.1', N'', NULL, NULL, NULL, 1, 1, 20, NULL, NULL, 566, NULL, NULL, NULL, NULL, NULL, N'Software', N'<p>Increase the use of MFA, such as by implementing enabling MFA (ideally, phishing-resistant MFA) by default for users and administrators.</p><p></p><p>Implementing “seat belt chimes” in products to nudge users towards enabling MFA. This could include, banners or interstitials notifying users or administrators that MFA is not enabled or suggesting that administrators enable phishing-resistant MFA.</p><p></p><p>Supporting standards-based single sign-on (SSO) in the baseline version of the product, allowing customers to configure with their own identity provider that supports MFA.</p>', N'Reduce the risk of password compromise or utilization of weak passwords.', NULL, N'More users use MFA to authenticate.', N'Increase the use of multifactor authentication (MFA)', NULL)
INSERT INTO [dbo].[MATURITY_QUESTIONS] ([Mat_Question_Id], [Question_Title], [Question_Text], [Supplemental_Info], [Category], [Sub_Category], [Maturity_Level_Id], [Sequence], [Maturity_Model_Id], [Parent_Question_Id], [Ranking], [Grouping_Id], [Examination_Approach], [Short_Name], [Mat_Question_Type], [Parent_Option_Id], [Supplemental_Fact], [Scope], [Recommend_Action], [Risk_Addressed], [Services], [Outcome], [Security_Practice], [Implementation_Guides]) VALUES (8515, N'IT/PD.2', N'', N'', NULL, NULL, 1, 2, 20, NULL, NULL, 566, NULL, NULL, NULL, NULL, NULL, N'Software', N'<p>Eliminate default passwords from the organization''s software products. Instead, take an alternate approach, such as:</p>
<ul>
<li>Providing random, instance-unique initial passwords for the product.</li><li>Requiring the user who installs the product to create a strong password at the start of the installation process.</li><li>Providing time-limited setup passwords that disable themselves when a setup process is complete and require configuration of a secure password (or more secure authentication approaches, such as phishing-resistant MFA).</li><li>Requiring physical access for initial setup and the specification of instance-unique credentials.</li><li>Conducting campaigns or offering updates that transition existing deployments from default passwords to more secure authentication mechanisms.</li>
</ul>', N'Adversaries may leverage manufacturer or supplier set default credentials on control system devices.', N'', N'The product does not use default passwords.', N'Reduce default passwords', NULL)
INSERT INTO [dbo].[MATURITY_QUESTIONS] ([Mat_Question_Id], [Question_Title], [Question_Text], [Supplemental_Info], [Category], [Sub_Category], [Maturity_Level_Id], [Sequence], [Maturity_Model_Id], [Parent_Question_Id], [Ranking], [Grouping_Id], [Examination_Approach], [Short_Name], [Mat_Question_Type], [Parent_Option_Id], [Supplemental_Fact], [Scope], [Recommend_Action], [Risk_Addressed], [Services], [Outcome], [Security_Practice], [Implementation_Guides]) VALUES (8516, N'IT/PD.3', N'', N'', NULL, NULL, 1, 3, 20, NULL, NULL, 566, NULL, NULL, NULL, NULL, NULL, N'Software', N'<p>Take approaches to work towards reduce entire classes of vulnerabilities, such as:</p>
<ul>
<li>Implement parameterized queries to reduce SQL injection vulnerabilities.</li><li>Transition to utilizing memory safe languages to reduce memory safety vulnerabilities.</li><li>Utilize web template frameworks to reduce cross-site scripting (XSS) vulnerabilities.</li>
</ul>', N'Code tampering, outdated code dependencies, data breaches', N'', N'Organizations should  proactively reduce systemic classes of vulnerabilities.', N'Reduce entire classes of vulnerabilities', NULL)
INSERT INTO [dbo].[MATURITY_QUESTIONS] ([Mat_Question_Id], [Question_Title], [Question_Text], [Supplemental_Info], [Category], [Sub_Category], [Maturity_Level_Id], [Sequence], [Maturity_Model_Id], [Parent_Question_Id], [Ranking], [Grouping_Id], [Examination_Approach], [Short_Name], [Mat_Question_Type], [Parent_Option_Id], [Supplemental_Fact], [Scope], [Recommend_Action], [Risk_Addressed], [Services], [Outcome], [Security_Practice], [Implementation_Guides]) VALUES (8517, N'IT/PD.4', N'', NULL, NULL, NULL, 1, 4, 20, NULL, NULL, 566, NULL, NULL, NULL, NULL, NULL, N'Software', N'<p>Provide security patches to customers in a timely manner and on a widespread basis.</p>', N'Initial access, privilege escalation, lateral 
movement', NULL, N'Security patches are offered on a widespread basis to customers.', N'Provide customers with security patching in a timely manner', NULL)
INSERT INTO [dbo].[MATURITY_QUESTIONS] ([Mat_Question_Id], [Question_Title], [Question_Text], [Supplemental_Info], [Category], [Sub_Category], [Maturity_Level_Id], [Sequence], [Maturity_Model_Id], [Parent_Question_Id], [Ranking], [Grouping_Id], [Examination_Approach], [Short_Name], [Mat_Question_Type], [Parent_Option_Id], [Supplemental_Fact], [Scope], [Recommend_Action], [Risk_Addressed], [Services], [Outcome], [Security_Practice], [Implementation_Guides]) VALUES (8518, N'IT/PD.5', N'', NULL, NULL, NULL, 1, 5, 20, NULL, NULL, 566, NULL, NULL, NULL, NULL, NULL, N'Software', N'<p>Notify customers and confirm receipt of notification stating 
product(s) are nearing end of life support and security patches will no longer be provided. </p>', N'Inadequate patching of software vulnerabilities exposes systems to significant 
risk', NULL, N'Users understand when software is no longer supported and will transition to supported products.', N'Ensure customers understand when products are nearing end of life support and security patches will no longer be provided ', NULL)
INSERT INTO [dbo].[MATURITY_QUESTIONS] ([Mat_Question_Id], [Question_Title], [Question_Text], [Supplemental_Info], [Category], [Sub_Category], [Maturity_Level_Id], [Sequence], [Maturity_Model_Id], [Parent_Question_Id], [Ranking], [Grouping_Id], [Examination_Approach], [Short_Name], [Mat_Question_Type], [Parent_Option_Id], [Supplemental_Fact], [Scope], [Recommend_Action], [Risk_Addressed], [Services], [Outcome], [Security_Practice], [Implementation_Guides]) VALUES (8519, N'IT/PD.6', N'', NULL, NULL, NULL, 1, 6, 20, NULL, NULL, 566, NULL, NULL, NULL, NULL, NULL, N'Software', N'<p>Include accurate Common Weakness Enumeration (CWE) and Common Platform Enumeration (CPE) fields in every Common Vulnerabilities and Exposures (CVE) record for the organization''s products. Additionally, 
issue CVEs in a timely manner for, at minimum, all critical or high impact vulnerabilities (whether discovered internally or by a third party) that either require actions by a customer to patch or have evidence of active exploitation.</p>', N'Initial access, privilege escalation, lateral movement, code misconfigurations, outdated code dependencies', NULL, N'CVEs that meet the defined criteria are published and CWE and CPE fields are included in all CVEs', N'Include Common Weakness Enumeration (CWE) and Common Platform Enumeration (CPE) fields in every Common Vulnerabilities and Exposures (CVE) record for the organization''s products.', NULL)
INSERT INTO [dbo].[MATURITY_QUESTIONS] ([Mat_Question_Id], [Question_Title], [Question_Text], [Supplemental_Info], [Category], [Sub_Category], [Maturity_Level_Id], [Sequence], [Maturity_Model_Id], [Parent_Question_Id], [Ranking], [Grouping_Id], [Examination_Approach], [Short_Name], [Mat_Question_Type], [Parent_Option_Id], [Supplemental_Fact], [Scope], [Recommend_Action], [Risk_Addressed], [Services], [Outcome], [Security_Practice], [Implementation_Guides]) VALUES (8520, N'IT/PD.7', N'', NULL, NULL, NULL, 1, 7, 20, NULL, NULL, 566, NULL, NULL, NULL, NULL, NULL, N'Software', N'<p>Verify whether all products, to the extent possible, have logging capabilities</p>', N'Initial access, privilege escalation, lateral movement', NULL, N'Customers have access and ability to monitor and respond to intrusions affecting the product', N'Increase the ability for customers to gather evidence of cybersecurity intrusions affecting the organization''s products', NULL)
INSERT INTO [dbo].[MATURITY_QUESTIONS] ([Mat_Question_Id], [Question_Title], [Question_Text], [Supplemental_Info], [Category], [Sub_Category], [Maturity_Level_Id], [Sequence], [Maturity_Model_Id], [Parent_Question_Id], [Ranking], [Grouping_Id], [Examination_Approach], [Short_Name], [Mat_Question_Type], [Parent_Option_Id], [Supplemental_Fact], [Scope], [Recommend_Action], [Risk_Addressed], [Services], [Outcome], [Security_Practice], [Implementation_Guides]) VALUES (8540, N'1.A', N'', NULL, NULL, NULL, 1, 1, 21, NULL, NULL, 567, NULL, NULL, NULL, NULL, NULL, N'C-Suite Personnel,
Critical section leadership, Physical & Cybersecurity Personnel, Third Party Contractors, Vendors, & Suppliers', N'<p>All roles and responsibilities involving cybersecurity should be documented in an organization’s policy, to include a single position responsible for the overall cybersecurity program.</p><p></p><p>Roles and responsibilities related to the cybersecurity policy and program are distributed across the organization. Third-party contractors can also be involved to assist with these activities.</p><p></p><p>Ensure that legal and regulatory requirements regarding cybersecurity, including privacy, are understood and managed.</p><p></p><p>Convergence of Information Technology (IT) and Operational Technology (OT) is recommended to streamline processes, enhance security measures, and boost operational effectiveness.</p>', N'Lack 
of sufficient cybersecurity accountability, investment, or effectiveness.', NULL, N'Roles, responsibilities, and authorities related to the organization''s cybersecurity program are established, communicated, understood, enforced, and alligned within the organization and external partners.', N'Establish Cybersecurity Responsibilities', NULL)
INSERT INTO [dbo].[MATURITY_QUESTIONS] ([Mat_Question_Id], [Question_Title], [Question_Text], [Supplemental_Info], [Category], [Sub_Category], [Maturity_Level_Id], [Sequence], [Maturity_Model_Id], [Parent_Question_Id], [Ranking], [Grouping_Id], [Examination_Approach], [Short_Name], [Mat_Question_Type], [Parent_Option_Id], [Supplemental_Fact], [Scope], [Recommend_Action], [Risk_Addressed], [Services], [Outcome], [Security_Practice], [Implementation_Guides]) VALUES (8541, N'1.B', N'', NULL, NULL, NULL, 1, 2, 21, NULL, NULL, 567, NULL, NULL, NULL, NULL, NULL, N'Third party vendors and service providers', N'<p>Procurement documents and contracts, such as service-level agreements (SLAs), stipulate that vendors and/or service providers notify the procuring customer of security incidents within a risk-informed time frame as determined by the organization.</p><p></p><p>Organization with OT assets need to document and track serial numbers, checksums, digital certificates/signatures or other 
identifying features that can enable them to verify the authenticity of vendor-provided OT hardware, software and firmware.</p>', N'Insufficient Cybersecurity Supply Chain Risk Management (C-SCRM) practices that cannot securely support the organization''s technologies & processes.', NULL, N'Organizations more rapidly learn about and respond to known incidents or breaches across vendors and service providers.', N'Monitor Supply Chain Incident Reporting & Vulnerability Disclosures', NULL)
INSERT INTO [dbo].[MATURITY_QUESTIONS] ([Mat_Question_Id], [Question_Title], [Question_Text], [Supplemental_Info], [Category], [Sub_Category], [Maturity_Level_Id], [Sequence], [Maturity_Model_Id], [Parent_Question_Id], [Ranking], [Grouping_Id], [Examination_Approach], [Short_Name], [Mat_Question_Type], [Parent_Option_Id], [Supplemental_Fact], [Scope], [Recommend_Action], [Risk_Addressed], [Services], [Outcome], [Security_Practice], [Implementation_Guides]) VALUES (8542, N'1.C', N'', NULL, NULL, NULL, 1, 3, 21, NULL, NULL, 567, NULL, NULL, NULL, NULL, NULL, N'Organization-wide', N'<p>Policies for managing the cybersecurity program are reviewed, updated, communicated, and enforced to reflect changes in requirements, threats, technology, and organizational mission. Policies are established based on organizational context, cybersecurity strategy, and priorities are communicated and enforced.  It is recommended that organizational governance encompass the policies, procedures, and processes necessary to manage the organization’s regulatory, legal, risk, environmental, and operational obligations.</p><p></p><p>OT-specific policies and proceedures should consider the limitations of existing IT cybersecurity program to identify priorities for critical operational functions, OT-specific security concerns and compensating controls.</p>', N'Insufficient cybersecurity policies and procedures/practices that can securely support the organization''s technologies & processes.', NULL, N'The organization’s cybersecurity risk management strategy, expectations, and policies are established, communicated, and monitored to identify 
any necessary adjustments.', N'Manage Cybersecurity Oversight', NULL)
INSERT INTO [dbo].[MATURITY_QUESTIONS] ([Mat_Question_Id], [Question_Title], [Question_Text], [Supplemental_Info], [Category], [Sub_Category], [Maturity_Level_Id], [Sequence], [Maturity_Model_Id], [Parent_Question_Id], [Ranking], [Grouping_Id], [Examination_Approach], [Short_Name], [Mat_Question_Type], [Parent_Option_Id], [Supplemental_Fact], [Scope], [Recommend_Action], [Risk_Addressed], [Services], [Outcome], [Security_Practice], [Implementation_Guides]) VALUES (8543, N'1.D', N'', NULL, NULL, NULL, 1, 4, 21, NULL, NULL, 567, NULL, NULL, NULL, NULL, NULL, N'Service providers that remotely manage an organization''s IT and/or OT infrastructure, cyber security, and/or other related business operations.', N'<p>Develop and maintain a thorough understanding of the services including security products a MSP and/or external vendors/integrators are providing via the contractual arrangement and address any security requirements that fall outside the scope of the contract.</p>', N'Adversaries can exploit organizations with access to their targets by abusing trusted third-party relationships.', NULL, N'The risks posed by an MSP are identified, recorded, assessed, prioritized, monitored, and updated over the course of the relationship.', N'Govern Risks from Managed Service Providers (MSPs)', NULL)
INSERT INTO [dbo].[MATURITY_QUESTIONS] ([Mat_Question_Id], [Question_Title], [Question_Text], [Supplemental_Info], [Category], [Sub_Category], [Maturity_Level_Id], [Sequence], [Maturity_Model_Id], [Parent_Question_Id], [Ranking], [Grouping_Id], [Examination_Approach], [Short_Name], [Mat_Question_Type], [Parent_Option_Id], [Supplemental_Fact], [Scope], [Recommend_Action], [Risk_Addressed], [Services], [Outcome], [Security_Practice], [Implementation_Guides]) VALUES (8544, N'2.A', N'', NULL, NULL, NULL, 1, 1, 21, NULL, NULL, 568, NULL, NULL, NULL, NULL, NULL, N'Data, Hardware, Software,
Systems, Facilities, Personnel', N'<p>Maintain a regularly updated inventory of all organizational assets (i.e.  data, hardware, software, systems, facilities, and personnel).   </p><p></p><p>IT and OT assets determined to be critical for business or operational functions are updated on a more frequent  basis.</p>', N'Adversaries might use computer accessories, networking hardware, or other devices as entry points to infiltrate systems or networks.', NULL, N'A maintained asset inventory to improve cybersecurity resilience by reducing downtime, aiding recovery, bolstering defenses, and improving preparedness.', N'Manage Organizational Assets', NULL)
INSERT INTO [dbo].[MATURITY_QUESTIONS] ([Mat_Question_Id], [Question_Title], [Question_Text], [Supplemental_Info], [Category], [Sub_Category], [Maturity_Level_Id], [Sequence], [Maturity_Model_Id], [Parent_Question_Id], [Ranking], [Grouping_Id], [Examination_Approach], [Short_Name], [Mat_Question_Type], [Parent_Option_Id], [Supplemental_Fact], [Scope], [Recommend_Action], [Risk_Addressed], [Services], [Outcome], [Security_Practice], [Implementation_Guides]) VALUES (8545, N'2.B', N'', NULL, NULL, NULL, 1, 2, 21, NULL, NULL, 568, NULL, NULL, NULL, NULL, NULL, N'Assets accessible through 
the internet', N'<p>Implement vulnerability management technologies to patch and mitigate misconfigured software in a timely manner. Monitor risk response progress through tools like  plan of action and milestones (POA&M), risk registers, and risk detail reports. Document potential risks of proposed changes and provide rollback guidance. Assign responsibilities and ensure procedures are followed for processing and responding to cybersecurity threats, vulnerabilities, or incident disclosures from various stakeholders. Incorporate compensating security controls (i.e., defense in depth) to address legacy systems where possible.</p>', N'Adversaries might exploit vulnerabilities in an Internet-facing host or system, such as software bugs, temporary glitches, or misconfigurations, to gain initial access to a network.', N'<a href="https://www.cisa.gov/known-exploited-vulnerabilities-catalog" target="_blank">Known Exploited Vulnerabilities Catalog </a>, <a href="https://www.cisa.gov/cyber-hygiene-services" target="_blank">CISA Cyber Hygiene Services</a>, <a href="https://www.cisa.gov/resources-tools/resources/free-cybersecurity-services-and-tools" target="_blank">Web Application Scanning</a>', N'Reduced likelihood of threat actors exploiting known vulnerabilities to breach organizational networks.', N'Mitigate Known Vulnerabilities', NULL)
INSERT INTO [dbo].[MATURITY_QUESTIONS] ([Mat_Question_Id], [Question_Title], [Question_Text], [Supplemental_Info], [Category], [Sub_Category], [Maturity_Level_Id], [Sequence], [Maturity_Model_Id], [Parent_Question_Id], [Ranking], [Grouping_Id], [Examination_Approach], [Short_Name], [Mat_Question_Type], [Parent_Option_Id], [Supplemental_Fact], [Scope], [Recommend_Action], [Risk_Addressed], [Services], [Outcome], [Security_Practice], [Implementation_Guides]) VALUES (8546, N'2.C', N'', NULL, NULL, NULL, 1, 3, 21, NULL, NULL, 568, NULL, NULL, NULL, NULL, NULL, N'Internal and external organizational assets and networks', N'<p>Organizations regularly engage third-party cybersecurity experts to validate their defenses through various exercises, to include penetration tests, bug bounties, incident simulations, and table-top exercises. These tests, both announced and unannounced, assess the ability of external and internal adversaries to infiltrate and move laterally within the network, targeting critical systems. High-impact findings from these tests are promptly addressed to prevent recurrence.</p>', N'Reduce risk of gaps in cyber defenses or a false sense of security in existing protections.', N'<a href="https://www.cisa.gov/resources-tools/services/stakeholder-exercises" target="_blank">Critical Infrastructure Exercises Support </a>', N'Ability to identify TTPs that lack proper defenses, and establish confidence in organizational cyber defenses.', N'Obtain Independent Validation of Cybersecurity Controls', NULL)
INSERT INTO [dbo].[MATURITY_QUESTIONS] ([Mat_Question_Id], [Question_Title], [Question_Text], [Supplemental_Info], [Category], [Sub_Category], [Maturity_Level_Id], [Sequence], [Maturity_Model_Id], [Parent_Question_Id], [Ranking], [Grouping_Id], [Examination_Approach], [Short_Name], [Mat_Question_Type], [Parent_Option_Id], [Supplemental_Fact], [Scope], [Recommend_Action], [Risk_Addressed], [Services], [Outcome], [Security_Practice], [Implementation_Guides]) VALUES (8547, N'2.D', N'', NULL, NULL, NULL, 1, 4, 21, NULL, NULL, 568, NULL, NULL, NULL, NULL, NULL, N'Organization-wide', N'<p>Organizations have, maintain, update, and regularly drill IT and OT cybersecurity incident response plans for both common and organizationally-specific (e.g., by sector, locality) threat scenarios and TTPs. When conducted, tests or drills are as realistic as feasible. Drill IR plans at least annually, and update within a risk-informed time frame following the lessons learned portion 
of any exercise, drill, or real world event.</p><p></p><p>OT IR plans, account for specific safety and containment considerations which differ from existing IT plans and priorities.</p>', N'Inability to 
quickly and effectively  isolate, contain, eradicate, remediate, and communicate about cybersecurity incidents.', N'<a href="https://www.cisa.gov/resources-tools/services/cisa-tabletop-exercise-packages" target="_blank">CISA Tabletop Exercise Packages</a>, <a href="https://www.cisa.gov/resources-tools/services/stakeholder-exercises" target="_blank">Critical Infrastructure Exercises Support</a>', N'Identify improvements by practicing cybersecurity & Incident response plans to maintain and update the organization’s cybersecurity program.', N'Maintain Incident Response (IR) Plans', NULL)
INSERT INTO [dbo].[MATURITY_QUESTIONS] ([Mat_Question_Id], [Question_Title], [Question_Text], [Supplemental_Info], [Category], [Sub_Category], [Maturity_Level_Id], [Sequence], [Maturity_Model_Id], [Parent_Question_Id], [Ranking], [Grouping_Id], [Examination_Approach], [Short_Name], [Mat_Question_Type], [Parent_Option_Id], [Supplemental_Fact], [Scope], [Recommend_Action], [Risk_Addressed], [Services], [Outcome], [Security_Practice], [Implementation_Guides]) VALUES (8548, N'2.E', N'', NULL, NULL, NULL, 1, 5, 21, NULL, NULL, 568, NULL, NULL, NULL, NULL, NULL, N'All public-facing assets and web domains', N'<p>Organizations maintain a public, easily discoverable method for security researchers to notify (e.g., via email address or web form) organizations’ security teams of vulnerable, misconfigured, or otherwise exploitable assets. Valid submissions are acknowledged and responded to in a timely manner, taking into account the completeness and complexity of the vulnerability. Validated and exploitable weaknesses are mitigated consistent with their severity.</p><p></p><p>Security researchers sharing vulnerabilities discovered in good faith are protected under Safe Harbor rules.</p>', N'Reporting known security vulnerabilities in a company''s software, networks, devices, and systems directly to the organization allows them to address and mitigate these vulnerabilities before adversaries can exploit them.', N'<a href="https://www.cisa.gov/coordinated-vulnerability-disclosure-process" target="_blank">CISA Coordinated Vulnerability Disclosure Process</a>, <a href="https://www.cisa.gov/vulnerability-disclosure-policy-template" target="_blank">Vulnerability Disclosure Policy Platform</a>, <a href="https://myservices.cisa.gov/irf" target="_blank">Incident Reporting</a>', N'Organizations more rapidly learn about vulnerabilities or weaknesses in their assets discovered by security researchers; researchers are more incentivized to responsibly share their findings.', N'Monitor Vulnerability Disclosure/Reporting', NULL)
INSERT INTO [dbo].[MATURITY_QUESTIONS] ([Mat_Question_Id], [Question_Title], [Question_Text], [Supplemental_Info], [Category], [Sub_Category], [Maturity_Level_Id], [Sequence], [Maturity_Model_Id], [Parent_Question_Id], [Ranking], [Grouping_Id], [Examination_Approach], [Short_Name], [Mat_Question_Type], [Parent_Option_Id], [Supplemental_Fact], [Scope], [Recommend_Action], [Risk_Addressed], [Services], [Outcome], [Security_Practice], [Implementation_Guides]) VALUES (8549, N'3.A', N'', NULL, NULL, NULL, 1, 1, 21, NULL, NULL, 569, NULL, NULL, NULL, NULL, NULL, N'Password-protected newly acquired and legacy IT and OT assets.', N'<p>Implement a organization-wide policy that requires changing default manufacturer passwords for all hardware, software, and firmware before connecting them to any internal or external network. This includes IT assets used in OT, such as OT administration web pages.</p><p></p><p>If changing default passwords is not feasible (e.g., due to hard-coded passwords in control systems), document and implement appropriate compensating security controls and monitor logs for network traffic and login attempts on these devices.</p><p></p><p>For OT: Changing default passwords on existing OT systems is 
more labor-intensive, recommend establishing a policy for changing default credentials on all new or future devices. This will reduce potential risk in the future if vulnerabilities change.</p>', N'Adversaries might acquire and exploit default account credentials to gain initial access, maintain persistence, escalate privileges, or evade defenses.', N'<a href="https://github.com/cisagov/bad-practices/discussions" target="_blank">CISA''s Bad Practices Catalog Discussions</a>', N'Prevent threat actors from using default passwords to achieve initial access or move laterally in a network.', N'Change Default Passwords', NULL)
INSERT INTO [dbo].[MATURITY_QUESTIONS] ([Mat_Question_Id], [Question_Title], [Question_Text], [Supplemental_Info], [Category], [Sub_Category], [Maturity_Level_Id], [Sequence], [Maturity_Model_Id], [Parent_Question_Id], [Ranking], [Grouping_Id], [Examination_Approach], [Short_Name], [Mat_Question_Type], [Parent_Option_Id], [Supplemental_Fact], [Scope], [Recommend_Action], [Risk_Addressed], [Services], [Outcome], [Security_Practice], [Implementation_Guides]) VALUES (8550, N'3.B', N'', NULL, NULL, NULL, 1, 2, 21, NULL, NULL, 569, NULL, NULL, NULL, NULL, NULL, N'User account passwords to  protected IT and OT assets', N'<p>Organizations have a system-enforced policy that requires a minimum password length of 16* or more characters for all password-protected IT assets and all OT assets, when technically feasible. Organizations should consider leveraging passphrases and password managers to make it easier for users to maintain sufficiently long passwords. In instances where minimum password lengths are not technically feasible, compensating controls are applied and recorded, and all login attempts to those assets are logged. Assets that cannot support passwords of sufficient strength length are prioritized for upgrade or replacement. </p><p></p><p>This goal is particularly important for organizations that lack widespread implementation of MFA and capabilities to protect against brute-force attacks (such as web application firewalls and third-party content delivery networks) or are unable to adopt passwordless authentication methods. </p><p></p><p>Modern attacker tools can crack eight-character passwords quickly. Length is a more impactful and important factor in password strength than 
complexity or frequent password rotations. Long passwords are also easier for users to create and remember.</p><p></p><p>OT assets that use a central authentication mechanism (such as Active Directory) are most important 
to address. Examples of low-risk OT assets that may not be technically feasible include those in remote locations, such as those on offshore rigs or on wind turbines.</p>', N'Attackers use brute force techniques to guess passwords when they are unknown or hashes are obtained. They systematically guess using repetitive methods, either interacting with services to validate credentials or working offline with acquired data.', N'<a href="https://www.cisa.gov/secure-our-world/use-strong-passwords" target="_blank">Use Strong Passwords</a>', N'Organizational passwords are harder for threat actors to guess or crack.', N'Establish Minimum Password Strength', NULL)
INSERT INTO [dbo].[MATURITY_QUESTIONS] ([Mat_Question_Id], [Question_Title], [Question_Text], [Supplemental_Info], [Category], [Sub_Category], [Maturity_Level_Id], [Sequence], [Maturity_Model_Id], [Parent_Question_Id], [Ranking], [Grouping_Id], [Examination_Approach], [Short_Name], [Mat_Question_Type], [Parent_Option_Id], [Supplemental_Fact], [Scope], [Recommend_Action], [Risk_Addressed], [Services], [Outcome], [Security_Practice], [Implementation_Guides]) VALUES (8551, N'3.C', N'', NULL, NULL, NULL, 1, 3, 21, NULL, NULL, 569, NULL, NULL, NULL, NULL, NULL, N'User accounts to protected IT and OT assets', N'<p>Organizations create distinct and separate credentials for similar services and asset access across IT and OT networks. Users refrain from reusing passwords for their accounts, applications, and services. Additionally, service/machine accounts have unique passwords that differ from those of regular user accounts. Role based accounts for IT and OT systems are utilized when possible.</p>', N'Attackers can obtain and exploit credentials of existing accounts to gain initial access, maintain persistence, escalate privileges, or evade defenses. These compromised credentials can bypass access controls within the network and be used for continuous access to remote systems and external services.', NULL, N'Attackers are unable to reuse compromised credentials to move laterally across the organization, particularly between IT and OT networks.', N'Create Unique Credentials', NULL)
INSERT INTO [dbo].[MATURITY_QUESTIONS] ([Mat_Question_Id], [Question_Title], [Question_Text], [Supplemental_Info], [Category], [Sub_Category], [Maturity_Level_Id], [Sequence], [Maturity_Model_Id], [Parent_Question_Id], [Ranking], [Grouping_Id], [Examination_Approach], [Short_Name], [Mat_Question_Type], [Parent_Option_Id], [Supplemental_Fact], [Scope], [Recommend_Action], [Risk_Addressed], [Services], [Outcome], [Security_Practice], [Implementation_Guides]) VALUES (8552, N'3.D', N'', NULL, NULL, NULL, 1, 4, 21, NULL, NULL, 569, NULL, NULL, NULL, NULL, NULL, N'Departing/Departed Employees', N'<p>A defined and enforced administrative process applied to all departing employees by the day of their departure that (1) revokes and securely returns all physical badges, key cards, tokens, etc., and (2) disables all user accounts and access to organizational resources.</p>', N'Attackers can exploit inactive accounts of former employees to evade detection, since the original user is not around to spot unusual activity of the account.', NULL, N'Prevent unauthorized access to organizational accounts or resources by former employees.', N'Revoke Credentials for Departing Employees', NULL)
INSERT INTO [dbo].[MATURITY_QUESTIONS] ([Mat_Question_Id], [Question_Title], [Question_Text], [Supplemental_Info], [Category], [Sub_Category], [Maturity_Level_Id], [Sequence], [Maturity_Model_Id], [Parent_Question_Id], [Ranking], [Grouping_Id], [Examination_Approach], [Short_Name], [Mat_Question_Type], [Parent_Option_Id], [Supplemental_Fact], [Scope], [Recommend_Action], [Risk_Addressed], [Services], [Outcome], [Security_Practice], [Implementation_Guides]) VALUES (8553, N'3.E', N'', NULL, NULL, NULL, 1, 5, 21, NULL, NULL, 569, NULL, NULL, NULL, NULL, NULL, N'Password-protected assets, where safe and technically capable', N'<p>All unsuccessful logins are logged and sent to an organization''s security team or relevant logging system. Security teams are notified (e.g., by an alert) after a specific number of consecutive unsuccessful login attempts in a short period and a deviation from normal user behavior. This alert is logged and stored in the relevant security or ticketing system for retroactive analysis. </p><p></p><p>For IT assets, a system-enforced policy prevents future logins for the suspicious account. For example, this could be for some minimum time, or until the account is re-enabled by a privileged user. This configuration is enabled when available on an asset.</p>', N'Attackers may attempt to access accounts by guessing passwords without prior knowledge of legitimate credentials. They might use repetitive methods and lists of common passwords, sometimes disregarding password complexity policies. However, this approach risks numerous authentication failures and potential account lockouts based on the organization''s policies.', NULL, N'Protect organizations from automated, credential-based attacks.', N'Detect Unsuccessful (Automated) Login Attempts', NULL)
INSERT INTO [dbo].[MATURITY_QUESTIONS] ([Mat_Question_Id], [Question_Title], [Question_Text], [Supplemental_Info], [Category], [Sub_Category], [Maturity_Level_Id], [Sequence], [Maturity_Model_Id], [Parent_Question_Id], [Ranking], [Grouping_Id], [Examination_Approach], [Short_Name], [Mat_Question_Type], [Parent_Option_Id], [Supplemental_Fact], [Scope], [Recommend_Action], [Risk_Addressed], [Services], [Outcome], [Security_Practice], [Implementation_Guides]) VALUES (8554, N'3.F', N'', NULL, NULL, NULL, 1, 6, 21, NULL, NULL, 569, NULL, NULL, NULL, NULL, NULL, N'Organizational ssets with remote access, such as workstations and human-machine interfaces (HMIs), where safe and technically capable', N'<p>Organizations require MFA for access to assets using the strongest available 
method, if MFA is available for that asset.</p><p></p><p> MFA options sorted by strength, high to low, are as follows:</p><p>1. Phishing-resistant MFA (e.g., FIDO/WebAuthn or public key infrastructure (PKI)-based – see CISA guidance in “Resources”).</p><p>2. If Phishing-resistant MFA is not available, then mobile app-based soft tokens (preferably push notification with number matching).</p><p>3. MFA via short message service (SMS) or voice only used when no other options are possible.</p><p></p><p>IT: All IT accounts leverage MFA to access organizational resources. Prioritize accounts with highest risk, such as privileged administrative accounts for key IT systems.</p><p></p><p>OT:  MFA is enabled on all accounts and systems that can be accessed remotely, including vendors/maintenance accounts, remotely accessible user and engineering workstations, and remotely accessible HMIs when available.   If MFA is not available, remove remote access, introduce additional segmentation steps and credential management should be prioritized.</p>', N'Attackers without prior knowledge of legitimate credentials might try commonly used passwords across various accounts to gain access. They might also systematically guess passwords using repetitive or iterative methods.', NULL, N'Add a critical, additional layer of security to protect assets accounts whose credentials have been compromised.', N'Establish Phishing-Resistant Multifactor Authentication (MFA)', NULL)
INSERT INTO [dbo].[MATURITY_QUESTIONS] ([Mat_Question_Id], [Question_Title], [Question_Text], [Supplemental_Info], [Category], [Sub_Category], [Maturity_Level_Id], [Sequence], [Maturity_Model_Id], [Parent_Question_Id], [Ranking], [Grouping_Id], [Examination_Approach], [Short_Name], [Mat_Question_Type], [Parent_Option_Id], [Supplemental_Fact], [Scope], [Recommend_Action], [Risk_Addressed], [Services], [Outcome], [Security_Practice], [Implementation_Guides]) VALUES (8555, N'3.G', N'', NULL, NULL, NULL, 1, 7, 21, NULL, NULL, 569, NULL, NULL, NULL, NULL, NULL, N'Organizational assets, where safe and technically capable', N'<p>User accounts do not have administrator privileges. Administrators maintain separate user accounts for activities unrelated to their admin role, such as business email and web browsing. Privileges are revaluated on a recurring basis to validate continued need for a given set of permissions.</p>', N'Attackers might obtain and exploit credentials from existing accounts for initial access, persistence, privilege escalation, or defense evasion. These compromised credentials can bypass network access controls and provide continuous access to remote systems and external services.', NULL, N'Make it harder for threat actors to gain access to administrator or privileged accounts, even if common user accounts are compromised.', N'Separate User and Privileged Accounts', NULL)
INSERT INTO [dbo].[MATURITY_QUESTIONS] ([Mat_Question_Id], [Question_Title], [Question_Text], [Supplemental_Info], [Category], [Sub_Category], [Maturity_Level_Id], [Sequence], [Maturity_Model_Id], [Parent_Question_Id], [Ranking], [Grouping_Id], [Examination_Approach], [Short_Name], [Mat_Question_Type], [Parent_Option_Id], [Supplemental_Fact], [Scope], [Recommend_Action], [Risk_Addressed], [Services], [Outcome], [Security_Practice], [Implementation_Guides]) VALUES (8556, N'3.H', N'', NULL, NULL, NULL, 1, 8, 21, NULL, NULL, 569, NULL, NULL, NULL, NULL, NULL, N'Organizational assets, where safe and technically capable', N'<p>All connections to OT and/or other segmented networks are denied by default unless explicitly allowed (e.g., by IP address and port) for specific system functionality. Necessary communications paths between the primary enterprise network and isolated networks must pass through an intermediary, such as a properly configured firewall, bastion host, "jump box," or a demilitarized zone, which is closely monitored, captures network logs, and only allows connections from approved assets. </p><p></p><p>When applicable physically segment OT networks.</p>', N'Attackers are able to gather details about device communication patterns and may also attempt to list services on remote hosts and local network devices, identifying ones vulnerable to remote software exploitation.', NULL, N'Reduce the likelihood of adversaries accessing segmented networks if the primary enterprise network is compromised.', N'Establish Physical/Network Segmentation', NULL)
INSERT INTO [dbo].[MATURITY_QUESTIONS] ([Mat_Question_Id], [Question_Title], [Question_Text], [Supplemental_Info], [Category], [Sub_Category], [Maturity_Level_Id], [Sequence], [Maturity_Model_Id], [Parent_Question_Id], [Ranking], [Grouping_Id], [Examination_Approach], [Short_Name], [Mat_Question_Type], [Parent_Option_Id], [Supplemental_Fact], [Scope], [Recommend_Action], [Risk_Addressed], [Services], [Outcome], [Security_Practice], [Implementation_Guides]) VALUES (8557, N'3.I', N'', NULL, NULL, NULL, 1, 9, 21, NULL, NULL, 569, NULL, NULL, NULL, NULL, NULL, N'All employees, contractors, partners, suppliers, providers,  and all other users of the organization''s non-public resources.', N'<p>At least annual trainings for all organizational users to train personnel to recognize social engineering attempts and other common attacks, how to properly report attacks and suspicious activity, comply with acceptable use policies, and perform basic cyber hygiene tasks (e.g., choosing passwords, protecting credentials).</p><p></p><p>Identify the specialized roles within the organization that require additional cybersecurity training, such as physical and cybersecurity personnel, system administrators, finance personnel, senior leadership, and anyone with access to business-critical data. Provide role-based cybersecurity training to all those in specialized roles, including contractors, partners, suppliers, and other third parties.</p><p></p><p>Personnel should receive security awareness and training for the OT environment and specific application. In addition, organizations should identify, document and train all personnel who have significant OT roles and responsibilities.</p><p></p><p>New employees receive initial cybersecurity training within 10 days of onboarding and recurring training on at least an annual basis.</p>', N'Train users on recognizing access or manipulation attempts by attackers to lower the risk of successful spearphishing, social engineering, and other techniques that involve user interaction.', N'<a href="https://www.cisa.gov/resources-tools/training" target="_blank">CISA Training</a>', N'Organizational users learn and perform more secure behaviors.', N'Implement Cybersecurity Training', NULL)
INSERT INTO [dbo].[MATURITY_QUESTIONS] ([Mat_Question_Id], [Question_Title], [Question_Text], [Supplemental_Info], [Category], [Sub_Category], [Maturity_Level_Id], [Sequence], [Maturity_Model_Id], [Parent_Question_Id], [Ranking], [Grouping_Id], [Examination_Approach], [Short_Name], [Mat_Question_Type], [Parent_Option_Id], [Supplemental_Fact], [Scope], [Recommend_Action], [Risk_Addressed], [Services], [Outcome], [Security_Practice], [Implementation_Guides]) VALUES (8558, N'3.J', N'', NULL, NULL, NULL, 1, 10, 21, NULL, NULL, 569, NULL, NULL, NULL, NULL, NULL, N'All IT traffic and remote OT assets (those that communicate with external entities)', N'<p>Use encryption, digital signatures, and cryptographic hashes to protect the confidentiality and integrity of network communications.  </p><p></p><p>OT:  Use encryption for external connections and where latency issues would not result in an impact to the network.</p>', N'Attackers can position themselves between networked devices to enable network sniffing, data manipulation, or other attacks.', N'<a href="https://www.cisa.gov/quantum" target="_blank">CISA - Post-Quantum Cryptography Initiative</a>', N'Effective encryption deployed to maintain confidentiality of sensitive data and integrity on the organization''s network.', N'Utilize Strong & Agile Encryption', NULL)
INSERT INTO [dbo].[MATURITY_QUESTIONS] ([Mat_Question_Id], [Question_Title], [Question_Text], [Supplemental_Info], [Category], [Sub_Category], [Maturity_Level_Id], [Sequence], [Maturity_Model_Id], [Parent_Question_Id], [Ranking], [Grouping_Id], [Examination_Approach], [Short_Name], [Mat_Question_Type], [Parent_Option_Id], [Supplemental_Fact], [Scope], [Recommend_Action], [Risk_Addressed], [Services], [Outcome], [Security_Practice], [Implementation_Guides]) VALUES (8559, N'3.K', N'', NULL, NULL, NULL, 1, 11, 21, NULL, NULL, 569, NULL, NULL, NULL, NULL, NULL, N'All passwords, credentials, secrets, and other sensitive or controlled information', N'<p>Sensitive data, including credentials, are not stored in plaintext anywhere in the organization and can only be accessed by authenticated and authorized users. Credentials are stored in a secure manner, such as with a credential/password manager or vault, or other privileged account management solution. </p><p></p><p>Identify critical physical and electronic file types and data to protect while in transit and at rest. This may include personally identifiable information and sensitive, proprietary or trade secret information (e.g., PLC program code, robot programs, computer-aided drafting  (CAD) or computer aided manufacturing (MAC) files, operating manuals and documentation, electrical diagrams, network diagrams, historical production data).</p>', N'Attackers can steal operational data from production environments for 
personal gain or to plan future operations. This information can include design documents, schedules, and other artifacts that provide insights into operations.', NULL, N'Protect sensitive information from unauthorized access.', N'Secure Sensitive Data', NULL)
INSERT INTO [dbo].[MATURITY_QUESTIONS] ([Mat_Question_Id], [Question_Title], [Question_Text], [Supplemental_Info], [Category], [Sub_Category], [Maturity_Level_Id], [Sequence], [Maturity_Model_Id], [Parent_Question_Id], [Ranking], [Grouping_Id], [Examination_Approach], [Short_Name], [Mat_Question_Type], [Parent_Option_Id], [Supplemental_Fact], [Scope], [Recommend_Action], [Risk_Addressed], [Services], [Outcome], [Security_Practice], [Implementation_Guides]) VALUES (8560, N'3.L', N'', NULL, NULL, NULL, 1, 12, 21, NULL, NULL, 569, NULL, NULL, NULL, NULL, NULL, N'All organizational email infrastructure.', N'<p>On all corporate email infrastructure (1) STARTTLS is enabled, (2) Sender Policy Framework (SPF) and DomainKeys Identified Mail (DKIM) are enabled, and (3) Domain-based Message Authentication, Reporting, and Conformance (DMARC) is enabled and set to "reject."</p>', N'Attackers might send victims emails with malicious attachments or links, aiming to run harmful code on their systems. They can 
also conduct phishing through third-party services like social media platforms.', N'<a href="https://www.cisa.gov/news-events/directives/bod-18-01-enhance-email-and-web-security" target="_blank">CISA - Enhance Email and Web Security</a>', N'Reduce risk from common email-based threats, such as spoofing, phishing, and interception.', N'Enable Email Security', NULL)
INSERT INTO [dbo].[MATURITY_QUESTIONS] ([Mat_Question_Id], [Question_Title], [Question_Text], [Supplemental_Info], [Category], [Sub_Category], [Maturity_Level_Id], [Sequence], [Maturity_Model_Id], [Parent_Question_Id], [Ranking], [Grouping_Id], [Examination_Approach], [Short_Name], [Mat_Question_Type], [Parent_Option_Id], [Supplemental_Fact], [Scope], [Recommend_Action], [Risk_Addressed], [Services], [Outcome], [Security_Practice], [Implementation_Guides]) VALUES (8561, N'3.M', N'', NULL, NULL, NULL, 1, 13, 21, NULL, NULL, 569, NULL, NULL, NULL, NULL, NULL, N'All organizational assets', N'<p>A system-enforced policy that disables macros, or similar embedded code, by default on all devices to prevent automatic execution of code or application. </p><p></p><p>If macros must be enabled in specific circumstances, there is a policy for authorized users to request that macros are enabled on specific assets.</p>', N'Adversaries rely on users to open malicious files to execute code. Social engineering tactics could be used to convince users to open such files.', NULL, N'Reduce the risk from embedded macros and similar executive code, a common and highly effective threat actor TTP.', N'Disable Autorun & Macros by Default', NULL)
INSERT INTO [dbo].[MATURITY_QUESTIONS] ([Mat_Question_Id], [Question_Title], [Question_Text], [Supplemental_Info], [Category], [Sub_Category], [Maturity_Level_Id], [Sequence], [Maturity_Model_Id], [Parent_Question_Id], [Ranking], [Grouping_Id], [Examination_Approach], [Short_Name], [Mat_Question_Type], [Parent_Option_Id], [Supplemental_Fact], [Scope], [Recommend_Action], [Risk_Addressed], [Services], [Outcome], [Security_Practice], [Implementation_Guides]) VALUES (8562, N'3.N', N'', NULL, NULL, NULL, 1, 14, 21, NULL, NULL, 569, NULL, NULL, NULL, NULL, NULL, N'Organizational assets', N'<p>Implement policies and processes to develop, document, and maintain secure configurations for technology platforms, aligning with industry-accepted system hardening standards. Additionally, they enforce configuration restrictions to prevent unauthorized changes. </p><p></p><p>Technical configuration change control processes, prohibiting unauthorized changes unless approved are in-place. Test and document proposed changes in a non-production environment and analyze potential security impacts before implementation.</p>', N'Configuration and change management enables the organization 
to control frequent changes to its high-value assets so that disruptions are mitigated and benefits are optimized.', N'CISA''s CRR Supplemental Resource Guide Volume 3 Configuration and Change Management Version 1.1', N'Policies and procedures exist to manage system configurations and changes that are consistent with industry-accepted hardening standards.', N'Manage System Configurations & Changes', NULL)
INSERT INTO [dbo].[MATURITY_QUESTIONS] ([Mat_Question_Id], [Question_Title], [Question_Text], [Supplemental_Info], [Category], [Sub_Category], [Maturity_Level_Id], [Sequence], [Maturity_Model_Id], [Parent_Question_Id], [Ranking], [Grouping_Id], [Examination_Approach], [Short_Name], [Mat_Question_Type], [Parent_Option_Id], [Supplemental_Fact], [Scope], [Recommend_Action], [Risk_Addressed], [Services], [Outcome], [Security_Practice], [Implementation_Guides]) VALUES (8563, N'3.O', N'', NULL, NULL, NULL, 1, 15, 21, NULL, NULL, 569, NULL, NULL, NULL, NULL, NULL, N'Organizational assets', N'<p>Baseline configurations are documented, reviewed, and maintained, serving as the foundation for future builds, releases, or changes. They include security and privacy controls, operational procedures, system component details, network topology, and logical placement within the system architecture. As organizational systems evolve, new baseline configurations are created to reflect the current organization''s architecture.</p><p></p><p>The organization implements the principle of least functionality by permitting only the specific functions, protocols, and services necessary for OT operations.</p>', N'Delayed, insufficient, or incomplete ability to maintain or restore functionality of critical devices and service operations.
Reducing the attack surface is closely integrated with threat and vulnerability analyses, as well as system architecture and design.', NULL, N'Procedures are in place to create, document, and uphold secure baseline configurations for technology platforms, aligning with industry-recognized system hardening standards.', N'Document Device Configurations', NULL)
INSERT INTO [dbo].[MATURITY_QUESTIONS] ([Mat_Question_Id], [Question_Title], [Question_Text], [Supplemental_Info], [Category], [Sub_Category], [Maturity_Level_Id], [Sequence], [Maturity_Model_Id], [Parent_Question_Id], [Ranking], [Grouping_Id], [Examination_Approach], [Short_Name], [Mat_Question_Type], [Parent_Option_Id], [Supplemental_Fact], [Scope], [Recommend_Action], [Risk_Addressed], [Services], [Outcome], [Security_Practice], [Implementation_Guides]) VALUES (8564, N'3.P', N'', NULL, NULL, NULL, 1, 16, 21, NULL, NULL, 569, NULL, NULL, NULL, NULL, NULL, N'Organizational assets necessary for business operations', N'<p>Develop a list of all maintained backups, including installation media, license keys, configuration information, and backup retention period of the information.</p><p></p><p>Backup critical operations systems  in near-real-time, and frequently back up all systems necessary for operations at agreed-upon schedules.</p><p></p><p>Securely store backups offsite and offline. Test backups and recovery on a recurring basis, no less than once per year.</p><p></p><p>Before initiating restoration validate the integrity of backups and other 
assets intended for restoration. This verification process is to ensure that data is intact, accurate, and reliable, minimizing the risk of data corruption during the restoration process.</p><p></p><p>Check restoration assets for indicators of compromise, file corruption, and other integrity issues before use.  </p><p></p><p>Regularly test backup information to verify media reliability and information integrity.</p><p></p><p>Stored information for OT assets includes at a minimum: configurations, roles, programmable logic controller (PLC), engineering drawings, and tools.</p>', N'Attackers can disrupt critical systems to halt the delivery of products or services. They can also delete or remove built-in data and disable recovery services, preventing system recovery. Adversaries may turn off services designed to aid in recovering a corrupted system.', NULL, N'Organizations reduce data loss and service disruption risks while efficiently managing, responding to, and recovering from cyberattacks to ensure continuous service delivery.', N'Maintain System Backups & Restoration Integrity', NULL)
INSERT INTO [dbo].[MATURITY_QUESTIONS] ([Mat_Question_Id], [Question_Title], [Question_Text], [Supplemental_Info], [Category], [Sub_Category], [Maturity_Level_Id], [Sequence], [Maturity_Model_Id], [Parent_Question_Id], [Ranking], [Grouping_Id], [Examination_Approach], [Short_Name], [Mat_Question_Type], [Parent_Option_Id], [Supplemental_Fact], [Scope], [Recommend_Action], [Risk_Addressed], [Services], [Outcome], [Security_Practice], [Implementation_Guides]) VALUES (8565, N'3.Q', N'', NULL, NULL, NULL, 1, 17, 21, NULL, NULL, 569, NULL, NULL, NULL, NULL, NULL, N'Organizational networks', N'<p>Organizations maintain accurate documentation describing updated network topology and relevant information across all IT and OT networks. Network reviews should be performed and tracked on a annual basis and documentation updated when network topology changes are made.</p>', N'Incomplete or inaccurate understanding of network topology inhibits effective incident response and recovery.', NULL, N'More efficiently and effectively respond to cyberattacks and maintain service continuity.', N'Document Network Topology', NULL)
INSERT INTO [dbo].[MATURITY_QUESTIONS] ([Mat_Question_Id], [Question_Title], [Question_Text], [Supplemental_Info], [Category], [Sub_Category], [Maturity_Level_Id], [Sequence], [Maturity_Model_Id], [Parent_Question_Id], [Ranking], [Grouping_Id], [Examination_Approach], [Short_Name], [Mat_Question_Type], [Parent_Option_Id], [Supplemental_Fact], [Scope], [Recommend_Action], [Risk_Addressed], [Services], [Outcome], [Security_Practice], [Implementation_Guides]) VALUES (8566, N'3.R', N'', NULL, NULL, NULL, 1, 18, 21, NULL, NULL, 569, NULL, NULL, NULL, NULL, NULL, N'Organizational assets', N'<p>Implement an administrative policy and  process that requires review, testing, and approval before new hardware, firmware, or software (software version) is installed or deployed. </p><p></p><p>Organizations maintain a list of approved hardware, firmware, and software that includes specification of approved versions, when technically feasible.</p><p></p><p>Consider additional requirements for organizations with OT environments when deploying patches and updates. This includes testing and validation to ensure they do not impact operational capabilities or safety.</p>', N'Attackers can manipulate products or delivery mechanisms before they reach the final consumer, aiming to compromise data or systems. They can target devices that move across ICS and external networks, typically brought in by authorized personnel but not permanently staying in the environment.', NULL, N'Increase visibility into deployed technology assets, and reduce the likelihood of breach by users installing unapproved hardware, firmware, or 
software.', N'Establish Hardware & Software Approval Process', NULL)
INSERT INTO [dbo].[MATURITY_QUESTIONS] ([Mat_Question_Id], [Question_Title], [Question_Text], [Supplemental_Info], [Category], [Sub_Category], [Maturity_Level_Id], [Sequence], [Maturity_Model_Id], [Parent_Question_Id], [Ranking], [Grouping_Id], [Examination_Approach], [Short_Name], [Mat_Question_Type], [Parent_Option_Id], [Supplemental_Fact], [Scope], [Recommend_Action], [Risk_Addressed], [Services], [Outcome], [Security_Practice], [Implementation_Guides]) VALUES (8567, N'3.S', N'', NULL, NULL, NULL, 1, 19, 21, NULL, NULL, 569, NULL, NULL, NULL, NULL, NULL, N'Organizational assets', N'<p>Administrative and security-focused logs (e.g., operating systems, applications, and services; intrusion detection systems/intrusion prevention systems, firewall, data loss prevention, virtual private network) are collected and stored for use in both detection and incident response activities (e.g., forensics). </p><p></p><p>Typical events to be collected include maintenance functions (e.g., access control, configuration changes, backup and restore) OS functions and application (i.e., process) events. </p><p></p><p>Logs are stored in a central system, such as a security information and event management tool or central database, and can only be accessed or modified by authorized and authenticated users. Logs are stored for a duration informed by risk or pertinent regulatory guidelines.  </p><p></p><p>Security teams are notified when a critical log source is disabled.</p><p></p><p>For OT assets where logs are non-standard or not available, network traffic and communications between those assets and other assets is collected.</p>', N'Adversaries can alter components within a victim''s environment to disable defensive mechanisms. This includes impairing both preventative defenses like firewalls and anti-virus, as well as detection tools used to identify malicious behavior. This can affect both native and additional defenses set up by users and administrators.', NULL, N'Enhance visibility to detect and respond to cyberattacks while ensuring security logs are protected from unauthorized access and tampering.', N'Maintain Log Collection & Storage', NULL)
INSERT INTO [dbo].[MATURITY_QUESTIONS] ([Mat_Question_Id], [Question_Title], [Question_Text], [Supplemental_Info], [Category], [Sub_Category], [Maturity_Level_Id], [Sequence], [Maturity_Model_Id], [Parent_Question_Id], [Ranking], [Grouping_Id], [Examination_Approach], [Short_Name], [Mat_Question_Type], [Parent_Option_Id], [Supplemental_Fact], [Scope], [Recommend_Action], [Risk_Addressed], [Services], [Outcome], [Security_Practice], [Implementation_Guides]) VALUES (8568, N'3.T', N'', NULL, NULL, NULL, 1, 20, 21, NULL, NULL, 569, NULL, NULL, NULL, NULL, NULL, N'Organizational assets', N'<p>Organizations maintain policies and processes to ensure that unauthorized media and hardware are not connected to IT and OT assets, such as limiting use of USB devices and removable media or disabling AutoRun. </p><p></p><p>OT: When feasible, establish procedures to remove, disable, or otherwise secure physical ports to prevent the connection of unauthorized devices or establish procedures for granting 
access through approved exceptions.</p>', N'Attackers might infiltrate systems, including disconnected or air-gapped networks, by copying malware to removable media. They exploit Autorun features, causing the malware to execute once the media is inserted into a system.', NULL, N'Prevent malicious actors from achieving initial access or data exfiltration via unauthorized portable media devices.', N'Prohibit Connection of Unauthorized Devices', NULL)
INSERT INTO [dbo].[MATURITY_QUESTIONS] ([Mat_Question_Id], [Question_Title], [Question_Text], [Supplemental_Info], [Category], [Sub_Category], [Maturity_Level_Id], [Sequence], [Maturity_Model_Id], [Parent_Question_Id], [Ranking], [Grouping_Id], [Examination_Approach], [Short_Name], [Mat_Question_Type], [Parent_Option_Id], [Supplemental_Fact], [Scope], [Recommend_Action], [Risk_Addressed], [Services], [Outcome], [Security_Practice], [Implementation_Guides]) VALUES (8569, N'3.U', N'', NULL, NULL, NULL, 1, 21, 21, NULL, NULL, 569, NULL, NULL, NULL, NULL, NULL, N'Organizational assets on the public internet', N'<p>Minimize internet-facing assets whenever possible. Where necessary, prioritize keeping your software up to date with timely patches and updates. If unable to apply updates, ensure appropriate compensating controls are implemented to prevent common forms of exploitation.  All unnecessary OS applications, software (bloatware) and network protocols are disabled on internet-facing assets.</p><p></p><p>Logically segment organization networks and cloud-based platforms according to trust boundaries and platform types (e.g., IT, IoT, OT, mobile, guests), and permit required communications only between segments.</p>', N'Attackers might exploit weaknesses in internet-facing hosts or systems to gain initial network access, targeting software bugs, temporary glitches, or misconfigurations.', N'<a href="https://www.cisa.gov/resources-tools/resources/stuff-search" target="_blank">CISA - Stuff Off Search</a>', N'Unauthorized users cannot gain an initial system foothold by exploiting known weaknesses in internet-facing assets.', N'No Exploitable Services on The Internet', NULL)
INSERT INTO [dbo].[MATURITY_QUESTIONS] ([Mat_Question_Id], [Question_Title], [Question_Text], [Supplemental_Info], [Category], [Sub_Category], [Maturity_Level_Id], [Sequence], [Maturity_Model_Id], [Parent_Question_Id], [Ranking], [Grouping_Id], [Examination_Approach], [Short_Name], [Mat_Question_Type], [Parent_Option_Id], [Supplemental_Fact], [Scope], [Recommend_Action], [Risk_Addressed], [Services], [Outcome], [Security_Practice], [Implementation_Guides]) VALUES (8570, N'4.A', N'', NULL, NULL, NULL, 1, 1, 21, NULL, NULL, 570, NULL, NULL, NULL, NULL, NULL, N'Organization-wide', N'<p>Implement signature-based mechanisms (relying on known patterns or signatures of malicious code, used by antivirus software to identify and block threats) and non-signature-based mechanisms (focusing on zero-day attacks, behavior, heuristics, or anomalies) to detect and eradicate malicious code at system endpoints. Ensure antivirus software is updated, active, and configured to automatically scan emails and removable media (e.g., flash drives) for ransomware and other malware.</p><p></p><p>Using antivirus software with OT devices may require special practices, including compatibility checks, change management, and performance impact metrics. These practices should be employed to test new signatures and new versions of antivirus software.</p>', N'Malicious software can involve payloads, droppers, backdoors, and more. Attackers use malware to maintain control of remote machines, evade defenses, and execute post-compromise actions.', NULL, N'Monitoring for malware encompasses computing hardware, software, runtime environments, and their associated data to identify potentially adverse events.', N'Implement Malicious Code Protection', NULL)
INSERT INTO [dbo].[MATURITY_QUESTIONS] ([Mat_Question_Id], [Question_Title], [Question_Text], [Supplemental_Info], [Category], [Sub_Category], [Maturity_Level_Id], [Sequence], [Maturity_Model_Id], [Parent_Question_Id], [Ranking], [Grouping_Id], [Examination_Approach], [Short_Name], [Mat_Question_Type], [Parent_Option_Id], [Supplemental_Fact], [Scope], [Recommend_Action], [Risk_Addressed], [Services], [Outcome], [Security_Practice], [Implementation_Guides]) VALUES (8571, N'4.B', N'', NULL, NULL, NULL, 1, 2, 21, NULL, NULL, 570, NULL, NULL, NULL, NULL, NULL, N'Organization-wide', N'<p>Ensure the organization has defined clear criteria and process for adverse events.</p><p></p><p>If an adverse event is suspected, follow the protocol outlined in the incident response plan to escalate the situation.</p><p></p><p>Automate event information analysis as much as possible to extend the investigative timeline for managing suspected adverse events. This will give analysts the time and capacity to mitigate these events effectively.</p><p></p><p>Conduct role-specific training that informs analysts of the proper protocols and procedures to take in the event of a suspected cyber incident.</p><p></p><p>Organizations should account for OT-specific events 
and anomalies in their processes and environments. It''s important to recognize that certain tools and alerts for behaviors or events that could indicate an intrusion might actually be normal within the OT environment.</p>', N'Initial Access, Privilege Escalation, Lateral Movement', N'<a href="https://www.fema.gov/sites/default/files/documents/fema_planning-considerations-cyber-incidents_2023.pdf" target="_blank">Planning Considerations for Cyber Incidents</a>', N'Incidents are declared when adverse events meet the specified incident criteria.', N'Identify Adverse Events', NULL)
INSERT INTO [dbo].[MATURITY_QUESTIONS] ([Mat_Question_Id], [Question_Title], [Question_Text], [Supplemental_Info], [Category], [Sub_Category], [Maturity_Level_Id], [Sequence], [Maturity_Model_Id], [Parent_Question_Id], [Ranking], [Grouping_Id], [Examination_Approach], [Short_Name], [Mat_Question_Type], [Parent_Option_Id], [Supplemental_Fact], [Scope], [Recommend_Action], [Risk_Addressed], [Services], [Outcome], [Security_Practice], [Implementation_Guides]) VALUES (8572, N'5.A', N'', NULL, NULL, NULL, 1, 1, 21, NULL, NULL, 571, NULL, NULL, NULL, NULL, NULL, N'Organization-wide', N'<p>Securely share information consistent with response plans and information sharing agreements. Priorities for sharing information include preventing the spread of infections to other systems and networks.</p><p></p><p>Regularly update senior leadership on the status of major incidents.</p><p></p><p>Notify human resources when malicious insider activity has occurred.</p><p></p><p>Establish and follow media communications procedures for incident response that comply with the organization’s policies on media interaction and information disclosure.</p><p></p><p>Coordinating with partner organizations to share tactical and technical information on mitigating attacks across multiple entities is essential for enhancing security and resilience. This collaborative effort helps protect critical infrastructure from both cyber and physical threats.</p>', N'The inability to appropriately respond to incidents in a timely manner.

A compromise of a system, application or service that affects confidentiality, integrity, availability and/or safety.', N'<a href="https://www.cisa.gov/sites/default/files/publications/ci-threat-information-sharing-framework-508.pdf" target="_blank">Critical Infrastructure Threat Information Sharing Framework</a>', N'Coordinate crisis communication methods between internal and external organization partners and its critical suppliers.', N'Establish Incident Communication Procedures', NULL)
INSERT INTO [dbo].[MATURITY_QUESTIONS] ([Mat_Question_Id], [Question_Title], [Question_Text], [Supplemental_Info], [Category], [Sub_Category], [Maturity_Level_Id], [Sequence], [Maturity_Model_Id], [Parent_Question_Id], [Ranking], [Grouping_Id], [Examination_Approach], [Short_Name], [Mat_Question_Type], [Parent_Option_Id], [Supplemental_Fact], [Scope], [Recommend_Action], [Risk_Addressed], [Services], [Outcome], [Security_Practice], [Implementation_Guides]) VALUES (8573, N'5.B', N'', NULL, NULL, NULL, 1, 2, 21, NULL, NULL, 571, NULL, NULL, NULL, NULL, NULL, N'Organization-wide', N'<p>Organizations maintain codified policy and procedures on to whom and how to report all confirmed cybersecurity incidents to appropriate external entities (e.g., state/federal regulators or 
SRMA’s as required, ISAC/ISAO, as well as CISA).</p><p></p><p>Known incidents are reported to CISA as well as other necessary parties within time frames directed by applicable regulatory guidance or in the absence of guidance, as soon as safely capable.</p>', N'Without timely incident reporting, CISA and other groups are less able to assist affected organizations and lack critical insight into the broader threat landscape (such as whether a broader attack is occurring against a specific sector).', N'<a href="https://myservices.cisa.gov/irf?id=irf_incident_reporting_start" target="_blank">CISA - Incident Reporting</a>, <a href="https://www.cisa.gov/topics/cyber-threats-and-advisories/information-sharing/cyber-incident-reporting-critical-infrastructure-act-2022-circia" target="_blank">Cyber Incident Reporting for Critical Infrastructure Act of 2022 </a>, <a href="https://www.dhs.gov/sites/default/files/publications/Cyber%20Incident%20Reporting%20United%20Message.pdf" target="_blank">Cyber Incident Reporting</a>', N'CISA and other organizations are better able to provide assistance or understand the broader scope of a cyberattack.', N'Establish Incident Reporting Procedures', NULL)
INSERT INTO [dbo].[MATURITY_QUESTIONS] ([Mat_Question_Id], [Question_Title], [Question_Text], [Supplemental_Info], [Category], [Sub_Category], [Maturity_Level_Id], [Sequence], [Maturity_Model_Id], [Parent_Question_Id], [Ranking], [Grouping_Id], [Examination_Approach], [Short_Name], [Mat_Question_Type], [Parent_Option_Id], [Supplemental_Fact], [Scope], [Recommend_Action], [Risk_Addressed], [Services], [Outcome], [Security_Practice], [Implementation_Guides]) VALUES (8574, N'6.A', N'', NULL, NULL, NULL, 1, 1, 21, NULL, NULL, 572, NULL, NULL, NULL, NULL, NULL, N'Organizational assets', N'<p>Execute plans to recover and restore to service, business- or mission-critical assets or systems that might be impacted by a cybersecurity incident.</p><p></p><p>Complete post analysis to identify areas for improvement and refine the incident response plan. Focus on incorporating lessons learned, enhancing detection and response capabilities, updating policies and procedures, and ensuring that all stakeholders are informed of the changes.</p>', N'Disruption to availability of an asset, service, or system.', N'<a href="https://www.cisa.gov/resources-tools/programs/Incident-Response-Training" target="_blank">Incident Response Training</a>, <a href="https://www.cisa.gov/sites/default/files/2024-08/Federal_Government_Cybersecurity_Incident_and_Vulnerability_Response_Playbooks_508C.pdf" target="_blank">Cybersecurity Incident & Vulnerability Response Playbook</a>', N'Organizations are capable of safely and effectively recovering from a cybersecurity incident.', N'Execute Incident Recovery Plan & Improvement', NULL)
